INSERT INTO area_estrategica VALUES (1, 'Ambiente', 'Impulsar un modelo de desarrollo fundamentado en la sustentabilidad ecológica, cultural, social y política a través de la conservación y uso sustentable de la naturaleza y un ordenamiento ambiental basado  en el respeto a la soberanía y la diversidad biológica y cultural.');
INSERT INTO area_estrategica VALUES (2, 'Energía y Petróleo', 'Identificar fuente de energía alternativa y desarrollar mecanismos eficientes de generación, distribución y uso sustentable de la energía, favoreciendo el equilibrio entre  la conservación del ambiente, el desarrollo integral de las comunidades y las prioridades nacionales como potencia energética');
INSERT INTO area_estrategica VALUES (3, 'Telecomunicaciones', 'Mejorar los sistemas de telecomunicaciones y garantizar el acceso de toda la población a los mismos, fortaleciendo la participación popular, democrática y protagónica');
INSERT INTO area_estrategica VALUES (4, 'Política y Sociedad', 'Comprender los procesos sociales y políticos en Venezuela y nuestramérica, con miras a empoderar a las comunidades en los procesos de transformación de la sociedad venezolana y mejorar el diseño y la gestión de las políticas públicas');
INSERT INTO area_estrategica VALUES (5, 'Educación', 'Transformar el sistema educativo nacional para la generación de ciudadanas y ciudadanos comprometidas y comprometidos con la comprensión crítica y la transformación de la realidad individual, colectiva y nacional hacia la emancipación');
INSERT INTO area_estrategica VALUES (6, 'Vivienda, Hábitat y Desarrollo Urbano', 'Impulsar un desarrollo sostenible, donde las viviendas se inserten de manera orgánica en un hábitat seguro, saludable, justo y equitativo');
INSERT INTO area_estrategica VALUES (7, 'Salud Colectiva', 'Garantizar la salud integral de la población venezolana a través del mejoramiento de las condiciones de vida, los sistemas de prevención de enfermedades y la asistencia médica universal, fortaleciendo el Sistema Público Nacional de Salud');
INSERT INTO area_estrategica VALUES (8, 'Seguridad y Soberanía Alimentaria', 'Garantizar el acceso estable y oportuno a los alimentos en la calidad y cantidad necesaria para satisfacer los requerimientos de toda la población');
INSERT INTO area_estrategica VALUES (9, 'Minería, Metalúrgica y Materiales', 'Desarrollar un modelo sustentable que garantice la transformación de las materias primas en productos semielaborados y elaborados a través de procesos industriales, para satisfacer los requerimientos de la industria transformadora a fin de lograr con el uso razonable y planificado de los recursos naturales la diversificación industrial del país y la transformación de la sociedad');
INSERT INTO area_estrategica VALUES (10, 'Desarrollo Industrial', 'Garantizar el desarrollo de una plataforma industrial ambiental, social, cultural y políticamente sustentable, que se constituya en una fuerza formadora y transformadora de la sociedad venezolana hacia la independencia, la equidad y la justicia, proveyendo a los venezolanos con herramientas necesarias para alcanzar la Suprema Felicidad Social perdurable');
INSERT INTO area_estrategica VALUES (11, 'Seguridad Ciudadana y Convivencia Solidaria', 'Garantizar el derecho a la seguridad ciudadana, la igualdad y no discriminación, al hábitat y al disfrute de la ciudad como espacio colectivo de convivencia, así como la promoción de estrategias y mecanismos de control social para minimizar la conflictividad  y garantizar el derecho a la justicia requerida para satisfacer necesidades de la población');
