INSERT INTO frases_chavez VALUES (1, 'Seguiremos batallando por la verdadera unidad e integración de nuestros pueblos, pero no es con el imperialismo que vamos a integrarnos nosotros, ¡no!, bastante daño le hizo el imperio norteamericano al proyecto de Bolívar.', 'Acto con motivo del III Aniversario de la Misión Barrio Adentro. Teatro Municipal de Caracas, 21 de abril de 2006.', 'img/chavez/001.png');
INSERT INTO frases_chavez VALUES (2, 'A quienes apuestan, desde hace 200 años, cuando Bolívar convocó el Congreso Anfictiónico de Panamá, a nuestra división, debemos enfrentarlos avanzando en la integración, para insertarnos con posibilidad de éxito en este mundo.', 'Rueda de Prensa. Encuentro cuatrilateral de los presidentes de Argentina, Bolivia, Brasil y Venezuela. Iguazú, Argentina; 04 de mayo de 2006.', 'img/chavez/002.png');
INSERT INTO frases_chavez VALUES (3, 'El bolivarianismo recupera la conciencia de la gran nación, de la gran patria y, por tanto,de una integración verdadera y profunda desde el alma de los pueblos.', 'Entrevista al Presidente Chávez por el periodista Enzo Micalizzi, del Canal RAI-2 de Italia. 10 de mayo de 2006', 'img/chavez/003.png');
INSERT INTO frases_chavez VALUES (4, 'En Venezuela, la base fundamental de nuestro sistema de gobierno, de nuestro proyecto, no es otra hoy, 180 años después, que el proyecto socialista venezolano, a través de la democracia revolucionaria y bolivariana que está en marcha por los cuatro rumbos de Venezuela.', 'Inauguración de la Unidad Materno Infantil “Dr. Oswaldo Ismael Brito. Tucupita, estado Delta Amacuro; 20 de mayo de 2006.', 'img/chavez/004.png');
INSERT INTO frases_chavez VALUES (13, 'Estamos llamados a conocer en profundidad nuestras civilizaciones aborígenes, autóctonas, nuestras raíces.', 'Aló Presidente N° 256. Ciudad Sagrada de Tiwanaku, Bolivia; 28 de mayo de 2006.', 'img/chavez/013.png');
INSERT INTO frases_chavez VALUES (33, 'Es imposible que se piense en hacer una revolución sin que la juventud se convierta en el motor fundamental, aportando su pureza, amor, fuerza y pasión.', 'Entrega de becas y relanzamiento de la Fundación Gran Mariscal de Ayacucho.Teatro Teresa Carreño, 2 de mayo de 2006.', 'img/chavez/033.png');
INSERT INTO frases_chavez VALUES (34, 'El proceso revolucionario es como un río que va corriendo y enfrenta distintas situaciones que se van presentando, no es estático. Si no, no sería una revolución.', 'Primer Encuentro Nacional de Cajas Rurales 2006. Complejo de Eventos Bellas Artes, estado Lara.', 'img/chavez/034.png');
INSERT INTO frases_chavez VALUES (35, 'Lo que me quede de vida será para dársela íntegra al pueblo que amo: ¡Venezuela!', 'Inauguración de la Fase I del Acueducto Chirgua-El Cercado. 5 de mayo de 2006.', 'img/chavez/035.png');
INSERT INTO frases_chavez VALUES (36, 'El día que termine de morir el viejo tiempo y termine de nacer el nuevo tiempo, yo me podré ir tranquilo a donde sea; pero mientras tanto, estaré con ustedes al frente de esta batalla por la dignidad, la vida y el futuro de la Patria, enfrentando lo que haya que enfrentar.', 'II Gabinete Móvil Comunal. Barquisimeto, estado Lara; 06 de mayo de 2006.', 'img/chavez/036.png');
INSERT INTO frases_chavez VALUES (37, '¡Educación!, ¡educación!, ¡educación!: he allí la base fundamental de la conciencia, del despertar y de la Revolución.', 'Aló Presidente N° 256. Ciudad Sagrada de Tiwanaku, Bolivia; 28 de mayo de 2006.', 'img/chavez/037.png');
INSERT INTO frases_chavez VALUES (184, 'Respetamos a todos los pueblos del mundo. Queremos armonía y paz universal, que se acabe la era de los imperios que agreden a los más débiles.', 'II Gabinete Móvil Comunal. Barquisimeto, estado Lara; 06 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (64, 'Nunca antes Gobierno alguno había golpeado tanto al narcotráfico como el Gobierno Revolucionario.', 'Aló Presidente N° 251. Hato San Pablo Paeño, estado Apure; 2 de abril de 2006.', 'img/chavez/064.png');
INSERT INTO frases_chavez VALUES (65, 'La Revolución llegó a este país para cambiarlo a fondo, hasta el alma, hasta la médula.', 'Primer Encuentro Nacional de Estudiantes de la Universidad Bolivariana de Venezuela. Punto Fijo, 18 de abril de 2006.', 'img/chavez/065.png');
INSERT INTO frases_chavez VALUES (66, 'Sería como una tumba permitir que nuestros recursos energéticos se los sigan llevando a los países del Norte desarrollado y condenar a nuestros pueblos a la escasez, al atraso y a la miseria permanente.', 'Rueda de Prensa conjunta de los presidentes de Bolivia, Paraguay, Uruguay y Venezuela. Asunción, Paraguay; 19 de abril de 2006.', 'img/chavez/066.png');
INSERT INTO frases_chavez VALUES (67, 'Queremos que el petróleo venezolano sirva para la paz y para el amor, para sacar de la miseria a tanta gente.', 'Aló Presidente N° 253. Campo Oficina, municipio Simón Rodríguez, El Tigre, estado Anzoátegui; 23 de abril de 2006.', 'img/chavez/067.png');
INSERT INTO frases_chavez VALUES (68, 'Ningún país se desarrollará si no le da valor agregado a su materia prima.', 'Declaraciones del presidente Chávez. Iguazú, Argentina; 4 de mayo de 2006.', 'img/chavez/068.png');
INSERT INTO frases_chavez VALUES (93, 'Siempre contribuiré en la maduración política del pueblo y en el impulso profundo de este proceso.', 'Aló Presidente N° 252. Campo de Carabobo, 9 de abril de 2006.', 'img/chavez/093.png');
INSERT INTO frases_chavez VALUES (95, 'El saber popular le da al pueblo una fuerza infinita.', 'Aló Presidente N° 252. Campo de Carabobo, 9 de abril de 2006.', 'img/chavez/095.png');
INSERT INTO frases_chavez VALUES (96, 'Debemos poner por delante la verdadera política, porque es la política la que debe regir el destino de los pueblos y orientar los proyectos de desarrollo nacionales.', 'Entrevista radial de ALER (Asociación Latinoamericana de Educación Radiofónica) al presidente de la República Bolivariana de Venezuela, Hugo Chávez. Asunción, Paraguay; 19 de abril de 2006.', 'img/chavez/096.png');
INSERT INTO frases_chavez VALUES (97, 'Invito a los jóvenes a que vayan apuntalando la Revolución y sigan trabajando la ideología, el proyecto nacional, y profundizando el trabajo que deben hacer.', 'Aló Presidente N° 253. Campo Oficina, municipio Simón Rodríguez, El Tigre, estado Anzoátegui; 23 de abril de 2006.', 'img/chavez/097.png');
INSERT INTO frases_chavez VALUES (98, 'Ningún país se desarrollará si no le da valor agregado a su materia prima.', 'Declaraciones del presidente Chávez, Iguazú, Argentina; 04 de mayo de 2006.', 'img/chavez/098.png');
INSERT INTO frases_chavez VALUES (100, 'El único camino por donde no fallaremos, será por el camino de una genuina Revolución.', 'Primer Encuentro Nacional de Cajas Rurales 2006. Complejo de Eventos Bellas Artes, estado Lara. 5 de mayo de 2006.', 'img/chavez/100.png');
INSERT INTO frases_chavez VALUES (130, 'Estamos llamando a construir el socialismo del siglo XXI, un socialismo fresco y nuevo, no dogmático, flexible, impulsando la democracia participativa y la democracia protagónica.', 'Reunión con empresarios del Reino Unido. Canning House, Londres; 15 de mayo de 2006.', 'img/chavez/130.png');
INSERT INTO frases_chavez VALUES (123, 'Para que el pueblo se concrete en fuerza real, debe tener, primero que nada, conciencia; y para que el pueblo tenga conciencia, debe tener conocimiento y cultura.', 'Aló Presidente N° 252. Campo de Carabobo, 9 de abril de 2006.', 'img/chavez/123.png');
INSERT INTO frases_chavez VALUES (126, 'El capitalismo divide en pedazos: una élite minoritaria se enriqueció a través del modelo capitalista, y una gran mayoría fue explotada, dominada y esclavizada.', 'Primer Encuentro Nacional de Cajas Rurales 2006. Complejo de Eventos Bellas Artes, estado Lara. 5 de mayo de 2006.', 'img/chavez/126.png');
INSERT INTO frases_chavez VALUES (146, 'El nuestro es un proyecto que se inscribe en la bandera de Simón Rodríguez, donde la educación es un derecho humano fundamental; el nuestro es un proyecto socialista que garantiza educación gratuita y de calidad para todos.', 'Entrega de titularidad a docentes del estado Zulia. Plaza de Toros Monumental de Maracaibo, 10 de junio de 2006.', NULL);
INSERT INTO frases_chavez VALUES (127, 'Si el capitalismo sigue reinando en este planeta la vida se acabará, porque ya está rompiendo el equilibrio ecológico.', 'Inauguración de la Fase I del Acueducto Chirgua-El Cercado. Estación de Bombeo El Vidrio, estado Lara. 5 de mayo de 2006.', 'img/chavez/127.png');
INSERT INTO frases_chavez VALUES (128, 'Venezuela ha tomado la vanguardia mundial en la denuncia del imperialismo, fase superior del capitalismo, y en el impulso al socialismo.', 'Aló Presidente N° 254. Barquisimeto, estado Lara; 7 de mayo de 2006.', 'img/chavez/128.png');
INSERT INTO frases_chavez VALUES (131, 'El proyecto bolivariano avanza con éxito en lo social, en lo económico y en lo político; un proyecto absolutamente democrático, con relaciones productivas y positivas con el mundo entero.', 'Reunión con empresarios del Reino Unido. Canning House, Londres; 15 de mayo de 2006.', 'img/chavez/131.png');
INSERT INTO frases_chavez VALUES (134, 'En Venezuela, la base fundamental de nuestro sistema de gobierno, de nuestro proyecto, no es otra hoy, 180 años después, que el proyecto socialista venezolano, a través de la democracia revolucionaria y bolivariana que está en marcha por los cuatro rumbo revolucionaria y bolivariana que está en marcha por los cuatro rumbos de Venezuela.', 'Inauguración de la Unidad Materno Infantil “Dr. Oswaldo Ismael Brito. Tucupita, estado Delta Amacuro; 20 de mayo de 2006.', 'img/chavez/134.png');
INSERT INTO frases_chavez VALUES (135, 'Estamos dando pasos firmes y bien orientados en el establecimiento y la práctica, el desarrollo, el ejercicio de una nueva economía dinámica, diversificada, productiva y, además, humanista, que esté al servicio de lo social.', 'Aló Presidente Nº 255. Ciudad Guayana, Estado Bolívar; 21de mayo de 2006.', 'img/chavez/135.png');
INSERT INTO frases_chavez VALUES (136, 'En el socialismo la economía está al servicio del ser humano y es un instrumento fundamental para generar igualdad.', 'Aló Presidente Nº 255. Ciudad Guayana, Estado Bolívar; 21de mayo de 2006.', 'img/chavez/136.png');
INSERT INTO frases_chavez VALUES (138, 'El socialismo se construye todos los días, no es un estadio a futuro al que llegaremos un día mágico, ¡no!, todos los días avanzamos construyéndolo y derrotando al capitalismo.', 'Firma de acuerdos, convenios y memorandos de entendimiento en el marco del ALBA y el TCP. Patio Central del Palacio de Gobierno de La Paz, Bolivia.; 26 de mayo de 2006.', 'img/chavez/138.png');
INSERT INTO frases_chavez VALUES (139, 'El socialismo del siglo XXI es una invención que está en pleno desarrollo, no hay fórmulas, se requiere mucha inventiva, creatividad y, sobre todo, conciencia.', 'Conferencia de prensa del presidente Chávez. Residencia del Embajador de Venezuela, Quito, Ecuador. 30 de mayo de 2006.', 'img/chavez/139.png');
INSERT INTO frases_chavez VALUES (140, 'Hay que demoler los restos de la IV República para terminar de construir la V República, la República socialista y bolivariana.', 'Marcha y concentración “El rugido de los precursores. Plaza Bicentenaria del Palacio de Miraflores. 3 de junio de 2006.', 'img/chavez/140.png');
INSERT INTO frases_chavez VALUES (141, 'Al capitalismo le interesa es el dinero, no le importa si acaba con los bosques, con las aguas y con la vida. Por el camino del socialismo es que podemos recuperar el equilibrio perdido en el planeta, porque se coloca por delante la vida humana.', 'Aló Presidente N° 257. Parque Nacional El Ávila, 4 de junio de 2006.', 'img/chavez/141.png');
INSERT INTO frases_chavez VALUES (142, 'Sólo el socialismo integra a la naturaleza y al ser humano, y nos permitirá restituir el equilibrio perdido.', 'Aló Presidente N° 257. Parque Nacional El Ávila, 4 de junio de 2006.', 'img/chavez/142.png');
INSERT INTO frases_chavez VALUES (148, 'Vean cómo terminó Cristo: enfrentado al capitalismo y al imperialismo.', 'Aló Presidente Nº 258. Villa Bruzual, estado Portuguesa; 11 de junio de 2006.', 'img/chavez/035.png');
INSERT INTO frases_chavez VALUES (144, 'La cogestión por sí sola no basta, porque no es garantía de que hayamos salido del sistema capitalista, ¡no!, más allá está el compromiso del trabajo social y el cambio de las relaciones de producción.', 'Pago de prestaciones sociales 2002-2003 al personal docente, administrativo y obrero de las universidades nacionales. Salón Ayacucho, Palacio de Miraflores; 8 de junio de 2006.', NULL);
INSERT INTO frases_chavez VALUES (149, 'La Revolución se alimenta de la conciencia de un pueblo.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (145, '¿Cuál es la causa de las grandes guerras que al mundo han azotado? ¡La avaricia capitalista!', 'Entrega de titularidad a docentes del estado Zulia. Plaza de Toros Monumental de Maracaibo, 10 de junio de 2006.', NULL);
INSERT INTO frases_chavez VALUES (147, 'El socialismo robinsoniano es una de las más poderosas raíces del nuevo socialismo del siglo XXI que hemos comenzado a construir en Venezuela.', 'Entrega de titularidad a docentes del estado Zulia Plaza de Toros Monumental de Maracaibo; 10 de junio de 2006.', NULL);
INSERT INTO frases_chavez VALUES (153, 'La universidad que necesitamos debe estar al servicio del pueblo, al servicio del proyecto nacional de desarrollo; no al servicio de intereses particulares o de las élites. ¡Es la universidad para la transformación!', 'Declaraciones del presidente Chávez durante la inauguración de Aldeas Universitarias 5 de abril de 2006', NULL);
INSERT INTO frases_chavez VALUES (154, 'La democracia meramente representativa se convierte en una trampa que encierra y mata las esperanzas de un pueblo.', 'Aló Presidente N° 252. Campo de Carabobo, 9 de abril de 2006. ', NULL);
INSERT INTO frases_chavez VALUES (155, 'El Gobierno no es Chávez ni es de Chávez. Tampoco el Gobierno está en Caracas, el Gobierno está en todas partes, porque esta es una revolución que está creando mecanismos de Gobierno popular: ¡el pueblo es el Gobierno!', 'Inauguración de la Unidad Materno Infantil “Dr. Oswaldo Ismael Brito. Tucupita, estado Delta Amacuro; 20 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (156, '¡No podemos subestimar la fuerza tremenda de nuestros pueblos!', 'Firma de acuerdos, convenios y memorandos de entendimiento en el marco del ALBA y el TCP. Patio Central del Palacio de Gobierno de La Paz, Bolivia.; 26 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (159, 'Muchos pueblos despiertan, pero a veces se dispersan por los caminos porque no consiguen un liderazgo que los encarne, que los asuma, que los lleve en su corazón.', 'Aló Presidente N° 256. Ciudad Sagrada de Tiwanaku, Bolivia; 28 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (161, 'Cuando un pueblo despierta, se llena de coraje y decide ser libre, jamás podrá ser derrocado.', 'Aló Presidente N° 256. Ciudad Sagrada de Tiwanaku, Bolivia; 28 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (162, 'No se trata del monarca Chávez absoluto y el pueblo cero, ¡no!, es al revés: el pueblo todo y Chávez cero; ustedes son todo, nosotros somos lo que ustedes digan, y haremos lo que ustedes digan.', 'Lanzamiento de la Red Humanista Misioneros del Milagro. Teatro Teresa Carreño, 14 de Junio 2006.', NULL);
INSERT INTO frases_chavez VALUES (165, 'Los Consejos Comunales no deben ser apéndices de la alcaldía ni de la gobernación, deben estar trabajando coordinadamente con los poderes, para darle profundidad al proyecto de la democracia revolucionaria.', 'Aló Presidente N° 252. Campo de Carabobo, 9 de abril de 2006.', NULL);
INSERT INTO frases_chavez VALUES (167, 'De la batalla que libren los Consejos Comunales dependerá que dejemos atrás los vicios de la falsa democracia y acabemos con las élites de la democracia representativa, y vayamos construyendo la democracia revolucionaria, participativa, protagónica, rumbo al socialismo.', 'II Gabinete Móvil Comunal. Barquisimeto, estado Lara; 06 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (170, 'Cuando proliferen los Consejos Comunales, cuando los vea, los palpe, los sienta, sólo entonces me atrevería a decir: ¡Esta revolución dio un salto adelante y no tiene retorno! Porque es un pueblo en colectivo asumiendo el Gobierno comunal.', 'III Gabinete Móvil de Consejos Comunales. Tucupita, estado Delta Amacuro; 20 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (172, 'Les pido, como pediría por mi vida, que avancemos en la profundización de la democracia revolucionaria y de los autogobiernos populares, ¡debe ser el pueblo quien gobierne!', 'Inauguración de la Unidad Materno Infantil “Dr. Oswaldo Ismael Brito. Tucupita, estado Delta Amacuro; 20 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (174, 'Debemos comenzar a sembrar las semillas adecuadas: nuevas relaciones sociales de producción marcadas por el humanismo, la solidaridad, la corresponsabilidad, para el desarrollo integral del país. ', 'Aló Presidente Nº 255. Ciudad Guayana, Estado Bolívar; 21 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (176, 'Sigan organizando los Consejos Comunales en cada barrio, para hacer un diagnóstico de los problemas e ir buscando las soluciones; ¡el compromiso social es de todos!', 'Entrega de titularidad a docentes del estado Zulia. Plaza de Toros Monumental de Maracaibo, 10 de junio de 2006.', NULL);
INSERT INTO frases_chavez VALUES (178, 'Los Consejos Comunales son el corazón de la Revolución, porque ahora sí el poder popular está prendiendo, echando raíces, y esta es la garantía más grande de su éxito en el futuro.', 'Entrega de Financiamientos a los primeros 200 Bancos Comunales. Teatro Teresa Carreño, 15 de junio de 2006', NULL);
INSERT INTO frases_chavez VALUES (180, 'Venezuela es una amenaza para el capitalismo neoliberal y el salvajismo. Somos una amenaza porque estamos demostrando que sí se puede —en paz— hacer una revolución.', 'Aló Presidente N° 251. Hato San Pablo Paeño, estado Apure; 2 de abril de 2006.', NULL);
INSERT INTO frases_chavez VALUES (183, 'En Washington hay un loco, hay un genocida, hay una persona que no tiene respeto por los más mínimos valores del ser humano.', 'Acto con motivo del III Aniversario de la Misión Barrio Adentro. Teatro Municipal de Caracas, 21 de abril de 2006.', NULL);
INSERT INTO frases_chavez VALUES (175, 'Los Consejos Comunales deben seguir haciendo proyectos, contraloría social, ayudándonos a luchar contra la burocratización, la ineficiencia, la corrupción, limpiando el terreno y sembrándolo de valores humanos, de hermandad, de solidaridad.', 'Colocación de la piedra fundacional del desarrollo habitacional “Terrazas del Alba. Municipio Libertador, Distrito Capital; 2 de junio de 2006.', 'img/chavez/125.png');
INSERT INTO frases_chavez VALUES (182, 'La Patria requiere al pueblo adiestrado, capacitado y entrenado para la defensa integral del país.', 'Aló Presidente N° 252. Campo de Carabobo, 9 de abril de 2006.', 'img/chavez/082.png');
INSERT INTO frases_chavez VALUES (158, 'En Venezuela, después de tantos años de traiciones y frustraciones, se presentó el fenómeno: el despertar del pueblo venezolano.', 'Aló Presidente N° 256. Ciudad Sagrada de Tiwanaku, Bolivia; 28 de mayo de 2006.', 'img/chavez/125.png');
INSERT INTO frases_chavez VALUES (185, 'El imperialismo llama a la guerra contra el populismo radical, contra el fundamentalismo, pero lo que quieren es frenar la posibilidad de una real democracia que está tratando de emerger en el mundo; en Venezuela ya emergió y está en marcha.', 'Aló Presidente N° 254. Barquisimeto, estado Lara; 7 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (186, 'Ya en Venezuela no nos mandan desde el Pentágono, la Casa Blanca o la embajada de los Estados Unidos: ¡somos libres y más nunca seremos esclavos, cuéstenos lo que nos cueste! ', 'Rueda de Prensa con la prensa italiana y agencias internacionales. Hotel Parco dei Principi, Roma, Italia; 11 de mayo 2006.', NULL);
INSERT INTO frases_chavez VALUES (188, 'El imperio norteamericano nos ha traído una nueva guerra mundial: la llamada ‘guerra preventiva’. ¡Con la excusa de luchar contra el terrorismo arremeten con terrorismo contra los pueblos del mundo!', 'Encuentro del presidente Chávez con el Movimiento “Manos Fuera de Venezuela. Viena, Austria; 12 mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (191, 'Existe un desespero en las derechas y las extremas derechas, hay un desespero en los cachorros del imperio; pero no por Chávez, ¡yo soy un ser insignificante al lado del gigante que es el pueblo latinoamericano que despierta!', 'Declaraciones del presidente Chávez a su llegada a la inauguración de la IV Cumbre de Jefes de Estado y de Gobierno de América Latina, el Caribe y la Unión Europea. Viena, Austria; 12 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (192, '¡No aceptamos la imposición de un ‘policía universal’! Queremos que se respeten las leyes internacionales para asegurar la paz.', 'Declaraciones del presidente Chávez a la salida de la reunión con el jefe de Gobierno de Austria, Heinz Fischer. Viena, Austria; 13 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (193, '¡Se cae el imperio! Hay que empujar duro para que termine de desplomarse, porque significaría la salvación del mundo.', 'Entrevista al Presidente Chávez, por Channel 4 News. Londres, Inglaterra; 15 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (194, 'Estados Unidos de Norteamérica es como una serpiente que envenena al mundo de odio, guerra, tragedia, desolación y muerte.', 'Inauguración de la Unidad Materno Infantil “Dr. Oswaldo Ismael Brito. Tucupita, estado Delta Amacuro; 20 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (197, 'En América Latina nos quieren imponer el modelo de democracia diseñado por los Estados Unidos, y al que no acepte entrar por ese carril lo acusan de populista radical, terrorista y dictador.', 'Aló Presidente Nº 255. Ciudad Guayana, Estado Bolívar; 21 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (198, 'Para tener Patria tenemos que enfrentar al imperio, desenmascararlo y derrotarlo en este siglo.', 'Firma de acuerdos, convenios y memorandos de entendimiento en el marco del ALBA y el TCP. Patio Central del Palacio de Gobierno de La Paz, Bolivia.; 26 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (199, 'Los soldados somos pueblo en uniforme, no podemos ser mercenarios a la orden de imperios extranjeros.', 'Aló Presidente Nº 256. Ciudad Sagrada de Tiwanaku, Bolivia; 28 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (200, 'El imperio norteamericano debe saber que si invaden a Venezuela, se concentrarán guerreros de toda esta América, no sólo pelearemos los venezolanos, pelearemos los latinoamericanos, porque los pueblos están conscientes de que en Venezuela se juega parte del destino de la América Latina.', 'Conferencia de prensa del presidente Chávez. Residencia del Embajador de Venezuela, Quito, Ecuador. 30 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (202, '¿Creen que es gratuita la campaña de todos los días por algunos canales de televisión, cuyas 24 horas de transmisión están dirigidas a dividir a los venezolanos? ¡Eso viene pagado desde el imperio!', 'Entrega de fusiles de asalto Kalashnikov AK-103. Patio de Honor del Ministerio de la Defensa. 14 de junio de 2006.', NULL);
INSERT INTO frases_chavez VALUES (206, 'La moral, el espíritu combativo y la conciencia patria deben ser las armas más poderosas que cada soldado tenga, el arma más poderosa que nuestro pueblo tenga.', 'Entrega de fusiles de asalto Kalashnikov AK-103. Patio de Honor del Ministerio de la Defensa. Patio de Honor del Ministerio de la Defensa. 14 de junio de 2006.', NULL);
INSERT INTO frases_chavez VALUES (207, 'El temor del imperio es la dignidad que nos mueve y el ejemplo de humanismo que damos al mundo.', 'Lanzamiento de la Red Humanista Misioneros del Milagro. Teatro Teresa Carreño, 14 de Junio 2006.', NULL);
INSERT INTO frases_chavez VALUES (211, 'Sólo la integración entre nosotros nos permitirá la fortaleza para luego hacer acuerdos justos con el Norte.', 'Primer Encuentro Nacional de Estudiantes de la Universidad Bolivariana de Venezuela. Punto Fijo, 18 de abril de 2006.', NULL);
INSERT INTO frases_chavez VALUES (212, 'La única manera en que nos podemos insertar con dignidad y en condiciones justas en el mundo postmoderno, el mundo del siglo XXI, es la integración del bloque de naciones, o como hemos dicho: una nación de repúblicas.', 'Rueda de prensa conjunta de los presidentes de Bolivia, Paraguay, Uruguay y Venezuela. Asunción, Paraguay; 19 de abril de 2006.', NULL);
INSERT INTO frases_chavez VALUES (213, '¡En América del Sur hay una rebelión de pueblo!', 'Entrevista radial de ALER (Asociación Latinoamericana de Educación Radiofónica) al presidente de la República Bolivariana de Venezuela, Hugo Chávez. Asunción, Paraguay; 19 de abril de 2006.', NULL);
INSERT INTO frases_chavez VALUES (190, 'El imperio norteamericano fue derrotado en Venezuela cuando se estrelló contra el coraje del pueblo que ha recuperado su libertad y está dispuesto a ser libre. ¡Venezuela más nunca será una colonia norteamericana!', 'Encuentro del presidente Chávez con el Movimiento “Manos Fuera de Venezuela. Viena, Austria; 12 mayo de 2006.', 'img/chavez/107.png');
INSERT INTO frases_chavez VALUES (215, 'Debemos fundamentarnos en la solidaridad, la cooperación y la complementariedad, en lugar de la competencia; sólo por ese camino lograremos una verdadera integración en Mercosur y en la Unión Suramericana.', 'Rueda de prensa entre el Presidente Hugo Chávez y el presidente electo de la República de Haití, René Preval. Palacio de Miraflores, 24 de abril de 2006.', NULL);
INSERT INTO frases_chavez VALUES (218, 'El gasoducto debe ser la locomotora de un proceso nuevo de integración, cuyo principal objetivo sea derrotar la pobreza y la exclusión.', 'Conferencia de Prensa del presidente Chávez con medios nacionales e internacionales. Sao Paulo, Brasil; 26 de abril de 2006.', NULL);
INSERT INTO frases_chavez VALUES (220, 'La integración del Sur es vital para todos nuestros pueblos.', 'Llegada del presidente Chávez a Brasil. Sao Paulo, Brasil; 26 de abril de 2006.', NULL);
INSERT INTO frases_chavez VALUES (223, 'No descansaremos en la tarea de la integración.', 'Aló Presidente N° 254. Barquisimeto, estado Lara; 7 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (224, 'El Mega Gasoducto del Sur, así como aquella asociación del hierro y el carbón, por allá en los años 50 en Europa, se conformó en el eje que impulsó la integración de la Unión Europea; se va a convertir en el eje central de nuestra integración.', 'Encuentro del presidente Chávez con miembros del Instituto Internacional para la Paz. Viena, Austria; 11 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (225, 'Un mundo con un solo polo de fuerza es el mundo del caos, lo cual ha ocurrido con el imperio norteamericano, que pretende ser el policía universal.', 'Entrevista al presidente Chávez por Channel 4 News. Londres, Inglaterra; 15 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (229, 'La Cruz del Sur está clarita en el horizonte, con sus dos estrellas laterales, Alfa Centauro y Beta Centauro… allá, sobre el horizonte de agua del delta infinito y hermoso del Orinoco…uno mira la Cruz del Sur y piensa: para allá es que vamos nosotros.', 'Aló Presidente Nº 255. Ciudad Guayana, estado Bolívar; 21 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (232, 'Creo que llegó la hora de conformar una poderosísima organización indígena latinoamericana, desde Guatemala hasta el Río de La Plata.', 'Aló Presidente N° 256. Ciudad Sagrada de Tiwanaku, Bolivia; 28 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (234, '¡Gracias a Dios!, los pueblos de América Latina están despertando. ¡Gracias a Dios!, nuevos gobiernos están llegando, con conciencia verdaderamente social, popular, con conciencia de nuestra historia.', 'Aló Presidente Nº 258. Villa Bruzual, estado Portuguesa; 11 de junio de 2006.', NULL);
INSERT INTO frases_chavez VALUES (235, 'Que la bandera venezolana tenga cada día mayor presencia, y además que nos vean como un factor de integración, es muy positivo, porque impulsa la moral del pueblo.', 'Rueda de prensa del presidente Chávez. Hotel Cæsar Park, República de Panamá; 23 de junio de 2006.', NULL);
INSERT INTO frases_chavez VALUES (239, 'Debemos pasar a una nueva etapa donde se imponga, no la competencia entre nuestros países, sino el principio de la solidaridad, la cooperación y la complementariedad entre nuestras economías.', 'Entrevista radial de ALER (Asociación Latinoamericana de Educación Radiofónica) al presidente de la República Bolivariana de Venezuela, Hugo Chávez. Asunción, Paraguay; 19 de abril de 2006.', NULL);
INSERT INTO frases_chavez VALUES (240, 'La Misión Barrio Adentro es ejemplo supremo, sublime y brillante de un nuevo y necesario modelo de integración: ¡estamos construyendo el ALBA!', 'Acto con motivo del III Aniversario de la Misión Barrio Adentro. Teatro Municipal de Caracas, 21 de abril de 2006.', NULL);
INSERT INTO frases_chavez VALUES (241, 'No es a través del comercio que nos vamos a unir, es a través de la política y, sobre todo, con la participación de nuestros pueblos.', 'Declaraciones del presidente Chávez. Iguazú, Argentina; 4 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (242, 'El petróleo hasta ahora ha sido un arma para dominar a los pueblos. Nosotros planteamos el petróleo como arma para liberarlos.', 'Encuentro del presidente Chávez con el pueblo italiano luego de su visita al Parlamento Italiano. Roma, Italia; 10 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (244, 'Ha fracasado el Consenso de Washington, que ha sumido en mayor miseria y pobreza a la América Latina. Nosotros hemos propuesto un nuevo modelo de integración que ponga por delante lo social, y le hemos llamado ALBA.', 'Declaraciones del presidente Chávez a la salida de la reunión con la presidenta de Chile, Michelle Bachelet. Viena, Austria; 11 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (219, 'El mundo necesita a la América Latina unida.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (237, 'Estados Unidos está proponiendo tratados de coloniaje, nosotros tratados de liberación y comercio, pero no libre comercio, ¡no!, comercio con justicia.', 'Aló Presidente N° 251. Hato San Pablo Paeño, estado Apure; 2 de abril de 2006.', 'img/chavez/019.png');
INSERT INTO frases_chavez VALUES (221, 'No tenemos otra alternativa que la integración para insertarnos con posibilidad de éxito en este mundo globalizado, para sacar a nuestros pueblos del atraso y la miseria, y llevar adelante un verdadero proyecto nacional, latinoamericano, de desarrollo integral, a un mundo en equilibrio y, por tanto, en paz.', 'Rueda de Prensa. Encuentro cuatrilateral de los presidentes de Argentina, Bolivia, Brasil y Venezuela. Iguazú, Argentina; 4 de mayo de 2006.', 'img/chavez/112.png');
INSERT INTO frases_chavez VALUES (247, 'Europa debe entender que en América Latina, afortunadamente para nuestros pueblos, fracasó el Consenso de Washington.', 'Declaraciones del presidente Chávez luego de la inauguración de la IV Cumbre de Jefes de Estado y de Gobierno de América Latina, el Caribe y la Unión Europea. Viena, Austria; 11 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (249, 'El proyecto neoliberal está en fuga en América Latina. Ahora se impone un Estado nacional sustentado en la voluntad popular.', 'Rueda de Prensa con la prensa italiana y agencias internacionales. Hotel Parco dei Principi, Roma, Italia; 11 de mayo 2006.', NULL);
INSERT INTO frases_chavez VALUES (250, 'Movimientos revolucionarios y transformadores van ocupando el poder en América Latina, en un rechazo abierto a las políticas fracasadas de Washington.', 'Entrevista al presidente Chávez por Channel 4 News. Londres, Inglaterra; 15 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (251, 'El ALCA es la más refinada propuesta imperialista que conozca la historia, ni el Imperio Romano le aplicaba a sus colonias o a las regiones conquistadas un mecanismo como este.', 'Aló Presidente Nº 255. Ciudad Guayana, estado Bolívar; 21 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (253, 'Al oponerse al ALCA, Venezuela está defendiendo los intereses de todo el país, incluyendo al sector privado nacional, que sería arrasado en una competencia desleal y salvaje por las grandes corporaciones transnacionales, sobre todo por los monopolios imperialistas.', 'Aló Presidente Nº 255. Ciudad Guayana, estado Bolívar; 21 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (255, 'Desde Washington conspiran contra nosotros, inventan historietas de todo tamaño y de todo color, forjan documentos, inventan pruebas falsas y sin embargo, Venezuela sigue avanzando en la integración.', 'Conferencia de prensa del presidente Chávez. Residencia del Embajador de Venezuela. Quito, Ecuador. 30 de mayo de 2006.', NULL);
INSERT INTO frases_chavez VALUES (258, 'Nos impusieron una doctrina extraña y contraria a nosotros mismos, contraria a nuestras raíces libertadoras, a nuestras raíces antiimperialistas, y eso tenemos que terminar de sacudirlo; así como a un exorcismo.', 'Intervención en el inicio del curso de Comando y Estado Mayor Conjunto Teatro Teresa Carreño, 10 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (260, 'En el buque Leander no nació el mariscal Miranda, ya existía; no nació el revolucionario Miranda, ya lo era; pero sí nació el primer suramericano libre, el primer gran líder de la revolución suramericana.', 'Mensaje Anual a la Nación Asamblea Nacional, 13 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (261, 'De Simón Bolívar extraemos la iluminación más grande para esta misión; la Negra Hipólita es la madre y es el padre de un pueblo, de quienes viven en la miseria.', 'Intervención durante el lanzamiento de la Misión Negra Hipólita Teatro Teresa Carreño, 14 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (262, 'No haremos el futuro grande que estamos buscamos si no conocemos el pasado grande que tuvimos.', 'Aló Presidente Nº 244. Palacio de Miraflores, 15 de enero de 2006.', NULL);
INSERT INTO frases_chavez VALUES (264, 'América Latina ha iniciado de nuevo el mismo proceso que quedó pendiente a Bolívar, San Martín, O’Higgins y Artigas: la Independencia.', 'Acto por la Lucha Antiimperialista de los Pueblos VI Foro Social Mundial Poliedro de Caracas, 27 de enero de 2006.', NULL);
INSERT INTO frases_chavez VALUES (266, 'Simón Bolívar es el autor intelectual del 4 de febrero de 1992, de la rebelión bolivariana de los jóvenes soldados venezolanos.', 'Intervención en la entrega del Premio Internacional de la Unesco “José Martí ', NULL);
INSERT INTO frases_chavez VALUES (269, 'El 27 de febrero de 1989 le tocó al pueblo venezolano abrir el camino; le tocó aportar su cuota de sacrificio, sangre y dolor para dar inicio a la Revolución Bolivariana.', 'Día de la Dignidad y de la Rebelión Bolivariana Avenida Bolívar de Caracas. 4 de febrero de 2006.', NULL);
INSERT INTO frases_chavez VALUES (272, 'Los soldados venezolanos estamos aquí para cumplir el mandato de Simón Bolívar, para empuñar nuestra espada cuando tengamos que empuñarla, para defender las garantías, la felicidad y la libertad de un pueblo, no para dominarlo, ultrajarlo o atropellarlo.', 'Día de la Dignidad y de la Rebelión Bolivariana Avenida Bolívar de Caracas. 4 de febrero de 2006.', NULL);
INSERT INTO frases_chavez VALUES (273, 'Nuestra Revolución viene de lejos: es la de Bolívar y es la de Zamora. Se había apagado, pero estaba avanzando por debajo de la tierra como esos ríos subterráneos que de repente salen de entre las rocas de una montaña y cogen sabana.', 'Acto con motivo de la entrega de pensiones de vejez Palacio de Miraflores, 17 de febrero de 2006.', NULL);
INSERT INTO frases_chavez VALUES (254, 'Los Tratados de Libre Comercio son un mecanismo neocolonialista, que buscan adueñarse de las riquezas naturales de nuestros países e imponernos el modelo hegemónico del imperialismo norteamericano.', 'Acto de masas con motivo de la visita del presidente Chávez a la República de Bolivia. Cochabamba, Bolivia; 26 de mayo de 2006.', 'img/chavez/031.png');
INSERT INTO frases_chavez VALUES (248, 'Ojalá la ‘chequera gorda gringa’, en vez de aterrorizar a los pueblos del mundo con bombas inteligentes e invasiones, la utilizaran para generar vida y educación como lo hacemos nosotros, movidos por la solidaridad.', 'Llegada del presidente Chávez al Hotel Hilton Danube. ', 'img/chavez/141.png');
INSERT INTO frases_chavez VALUES (265, 'Nacimos al calor de las doctrinas libertadoras y humanistas de Francisco de Miranda, Antonio José de Sucre, Simón Bolívar y Ezequiel Zamora. ¡Ésas son nuestras raíces militares, las raíces de nuestro pensamiento antiimperialista, humanista y libertador!', 'Desfile civicomilitar en ocasión del Septimo aniversario del Gobierno Bolivariano Patio de Honor de la Academia Militar, 2 de febrero de 2006.', 'img/chavez/049.png');
INSERT INTO frases_chavez VALUES (275, 'Hay que revisar la historia, incluso en el marco del capitalismo, ¿será que esos países del Norte se desarrollaron al nivel que llegaron en ese marco de libre comercio? ¡No! Nunca creyeron ni creen en él: Es una gran falacia.', 'Conferencia de prensa de los presidentes de Venezuela y Uruguay Palacio de Miraflores, 14 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (276, 'Si algún continente tiene un patrimonio intelectual cuajado con los años, y un conjunto de propuestas profundas para el desarrollo integral y para la construcción de espacios alternativos, es la América Latina y el Caribe; patrimonio que quiso ser borrado.', 'Seminario Internacional de Integración Financiera en América Latina y el Caribe Banco Central de Venezuela, 24 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (277, 'La raíz zamorana, la raíz bolivariana y la raíz robinsoniana: tres raíces de un mismo tronco y un árbol enraizado en el pensamiento nacional; ideología que impulsa el nuevo y verdadero bolivarianismo.', 'Aló Presidente N° 250 Valles del Tuy, 26 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (278, 'Estamos comenzando a mirar lo que el padre Libertador imaginaba: una inmensa región donde debe reinar la justicia, la igualdad y la libertad, ¡fórmula mágica para la vida de las naciones y la paz entre los pueblos!', 'Inauguración de La Central Hidroeléctrica Caruachi, estado Bolívar; 31 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (288, 'Cuando llegamos al gobierno, la inversión en educación no llegaba ni siquiera al 3% del Producto Interno Bruto; hoy estamos cerca del 8%.', 'Conmemoración de los 7 años del gobierno del presidente Hugo Chávez Frías Teatro Teresa Carreño, 2 de febrero de 2002', NULL);
INSERT INTO frases_chavez VALUES (289, 'Cada día voy a apurar más el paso. El que no pueda seguirme el ritmo que se vaya a otras cosas. No voy a frenar, porque así lo clama el pueblo.', 'Día de la dignidad y la Rebelión Bolivariana Avenida Bolívar de Caracas. 4 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (291, 'No podemos asumir las posiciones o actitudes del clásico poder constituido. Se equivoca el representante que se crea dueño de todo, ¡el dueño de todo es el pueblo venezolano!', 'Aló Presidente Nº 246 Cumaná, 5 febrero 2006', NULL);
INSERT INTO frases_chavez VALUES (292, 'Yo tengo que estar con ustedes, acompañándolos, ayudando a solucionar desde los problemas más menudos hasta los más graves problemas.', 'Primer Gabinete Móvil Comunal Teatro Teresa Carreño Lunes, 06 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (294, 'Las leyes tienen que subordinarse a las necesidades del pueblo.', 'Primer Gabinete Móvil Comunal Teatro Teresa Carreño Lunes, 06 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (296, '¡No habrá Revolución sin juventud revolucionaria!, ¡no habrá Patria sin juventud patriótica!', 'Inauguración de la Universidad Iberoamericana del Deporte San Carlos, estado Cojedes, 9 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (297, 'Tenemos el deber de buscar mil maneras y más para darle al pueblo la vida que necesita.', 'Entrega de Certificados de Vivienda del Núcleo de Desarrollo Endógeno Habitacional “Patria Bolivariana Maracaibo, 9 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (300, '¡No habrá Revolución sin juventud revolucionaria!, ¡no habrá Patria sin juventud patriótica!', 'Inauguración de la Universidad Iberoamericana del Deporte San Carlos, estado Cojedes, 9 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (301, 'Tenemos el deber de buscar mil maneras y más para darle al pueblo la vida que necesita.', 'Entrega de Certificados de Vivienda del Núcleo de Desarrollo Endógeno Habitacional “Patria Bolivariana” Maracaibo, 9 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (303, 'Estamos dejando atrás la democracia representativa y dándole vida a la nueva democracia revolucionaria, participativa, donde el pueblo impone las decisiones.', 'Rendición de cuentas de los Proyectos Comunitarios y Nuevos Proyectos en Conjunto Teatro Teresa Carreño, 10 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (283, 'Son tiranías disfrazadas de democracia lo que hemos tenido en estas tierras durante mucho tiempo. Hay que echar abajo las bases del Estado colonial y construir un nuevo Estado Social, una República nueva que sea expresión del poder constituyente.', 'Conferimiento del Doctorado Honoris Causa y Medalla “Mariscal Andrés de Santa Cruz al Presidente ChávezLa Paz, 23 de enero de 2006', 'img/chavez/048.png');
INSERT INTO frases_chavez VALUES (304, 'Debemos avanzar hacia una explosión masiva del conocimiento, de tecnología, de innovación, en función de las necesidades sociales y económicas del país y de la soberanía nacional.', 'Aló Presidente Nro. 247 Ciudad Guayana, 19 de febrero de 2006', 'img/chavez/028.png');
INSERT INTO frases_chavez VALUES (306, 'En el Gobierno siempre debemos buscar niveles superiores de eficiencia.', 'Juramentación de los ministros de Industrias Ligeras y Comercio, Agricultura y Tierras, Trabajo para la Economía Popular, Alimentación y Despacho de la Presidencia Palacio de Miraflores, 24 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (310, 'Quisiera yo tener un adversario digno, de altura, con el cual debatir proyectos; porque nosotros sí tenemos un proyecto, un proyecto político: la democracia participativa, la democracia protagónica.', 'Aló Presidente Nro. 249 Elorza, estado Apure; 19 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (313, 'La Revolución mandó a parar la música privatizadora y comenzaron a sonar los tambores de la patria y de un nuevo Estado responsable con la sociedad.', 'Activación de la Planta Termoeléctrica “Pedro Camejo” Valencia, Edo. Carabobo; 21 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (317, 'Cada día los pueblos van tomando mayor conciencia… y los resultados están a la vista.', 'Rueda de prensa ofrecida por el Presidente Chávez y el Presidente electo de Bolivia, Evo Morales, Palacio de Miraflores, 3 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (319, 'La participación popular tiene su vida, su génesis y su campo de acción en la comunidad.', 'Intervención en el acto de presentación de la nueva Junta Directiva de la Asamblea Nacional al Poder Ejecutivo. Palacio Blanco, 6 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (320, 'Ellos se olvidan de que aquí hay un pueblo consciente, un pueblo que despertó y un pueblo que sabe que este Gobierno está entrándole de lleno a todos los problemas, asumiendo y reconociendo errores cuando tenga que hacerlo.', 'Aló Presidente Nº 243 Núcleo de Desarrollo Endógeno José Félix Ribas. Estado Aragua, 8 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (323, 'Los líderes debemos estar atentos a las señales del pueblo.', 'Aló Presidente Nº 244 Palacio de Miraflores, 15 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (324, 'La única democracia en la que creemos es la democracia del pueblo, la democracia participativa, protagónica, cargada de fuerza e impulso popular.', 'Acto por la Lucha Antiimperialista de los Pueblos VI Foro Social Mundial. Caracas, 27 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (326, 'La Revolución tiene que avanzar desde abajo, con la organización comunitaria, para mejorar notablemente el nivel de vida de los barrios.', 'Aló Presidente Nº 245 Parroquia Antímano, 29 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (328, 'Debemos alimentar la cultura de la participación, hay que empujarla, y luego respetar la participación de todos.', 'Conmemoración de los 7 años del gobierno del presidente Hugo Chávez Frías, Teatro Teresa Carreño, 2 de febrero de 2002', NULL);
INSERT INTO frases_chavez VALUES (331, 'Tengo plena fe en el pueblo venezolano y sus grandes capacidades: verdadero Libertador de Venezuela, ¡verdadero creador de la Patria nueva!', 'Primer Gabinete Móvil Comunal, Teatro Teresa Carreño, 06 de Febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (333, 'Estamos entrando a una fase definitiva del poder constituyente y la revolución. Hemos tocado una veta de oro: El poder del pueblo, que se está desatando a través de la organización popular.', 'Rendición de Cuentas de los Proyectos Comunitarios y Nuevos Proyectos en Conjunto Teatro Teresa Carreño, 10 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (334, 'Invito a las comunidades a ir asumiendo el poder popular directamente, el poder constituyente, el poder soberano. Hemos ideado una figura en la que tengo mi vida empeñada: los consejos comunales.', 'Aló Presidente Nro. 248, Municipio Acevedo, Estado Miranda; 5 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (335, 'Yo no juego con el pueblo venezolano, sus sentimientos o con su emoción, ¡yo vivo con ese sentimiento!, ¡soy parte de ese sentimiento!, y junto a todos ustedes lucho para hacer realidad la esperanza nacida y el optimismo que ahora nos baña.', 'Aló Presidente Nro. 249, Elorza, estado Apure; 19 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (337, 'El poder constituido, los representantes, deben trabajar conjuntamente con las comunidades, promover la cooperación, trabajar en cooperación, corresponsabilidad, cogobierno.', 'Aló Presidente Nro. 249, Elorza, estado Apure; 19 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (338, 'Los líderes deben escuchar el clamor de sus pueblos.', 'Activación de la Planta Termoeléctrica “Pedro Camejo” Valencia, Edo. Carabobo; 21 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (307, 'La corrupción existe, y yo soy el primero en ponerme al frente y llamar al país a batallar contra ella en todos los frentes.', 'Aló Presidente Nro. 248 Municipio Acevedo, Estado Miranda; 5 de marzo de 2006', 'img/chavez/125.png');
INSERT INTO frases_chavez VALUES (314, 'Pido a todos la mayor dedicación posible para incrementar la eficiencia del Proceso Revolucionario en el ámbito político: No olvidemos que debemos trascender la democracia meramente representativa en democracia participativa, en democracia protagónica, en Democracia Revolucionaria.', 'Inauguración del Centro Médico de Diagnóstico de Alta Tecnología “10 de Marzo” La Guaira, 23 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (311, 'Hacia el norte: latifundio cero; hacia el sur: latifundio cero; hacia el este: latifundio cero; hacia el oeste: latifundio cero. Esa tarea no es sólo de Chávez, es una tarea de todos, cueste lo que cueste, para dejar una Patria libre de tantas rémoras que pretenden ahogarla.', 'Aló Presidente Nro. 249 Elorza, estado Apure; 19 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (316, 'Un gobierno apuntalado por su pueblo jamás caerá.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (308, 'Éramos una colonia petrolera, dependíamos de las decisiones que se tomaban en los Estados Unidos. Ahora no; es voluntad de nuestro Gobierno, de nuestro proceso revolucionario, de nuestro pueblo, virar hacia el Sur, y hemos comenzado a hacerlo.', 'Conferencia de prensa de los presidentes de Venezuela y Uruguay Palacio de Miraflores, 14 de marzo de 2006', 'img/chavez/103.png');
INSERT INTO frases_chavez VALUES (329, 'El poder popular es parte del poder militar, porque sin pueblo una Fuerza Armada está destinada al fracaso.', 'Aló Presidente Nº 246, Cumaná, 5 febrero 2006', 'img/chavez/049.png');
INSERT INTO frases_chavez VALUES (339, 'Uno de los elementos fundamentales del poder popular, es la capacidad del pueblo para hacer su propio diagnóstico social, elaborar sus propios proyectos comunitarios y solicitar el apoyo que nosotros estamos obligados a darle.', 'Inauguración del Centro Médico de Diagnóstico de Alta Tecnología “10 de Marzo” La Guaira, 23 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (340, 'Una poderosa fuerza se levantó y comenzó a imprimirle ritmo y dirección a un proceso, y no habrá fuerza capaz de detenerlo, porque se alimenta de la energía maravillosa que genera la conciencia de un pueblo.', 'Firma de acuerdos para la migración de los convenios operativos a las empresas mixtas Palacio de Miraflores, 31 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (346, 'Bienvenido el error, para reconocerlo, combatirlo y convertirlo en nueva invención; mal venido el engaño, porque es mortal para un proceso revolucionario.', 'Participación del inicio del nuevo período de sesiones ordinarias 2006 y presentación de la nueva Junta Directiva de la Asamblea Nacional al Poder Ejecutivo, Palacio Blanco, 6 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (347, 'No estamos en tiempos de posiciones defensivas, estamos en tiempos de ataque, en tiempos de ofensiva.', 'Intervención en la entrega del Premio Internacional de la UNESCO “José Martí”, La Habana, 3 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (348, 'Nosotros, los que luchamos por un mundo distinto y mejor; nosotros, los que levantamos las banderas de la revolución, estamos en la ofensiva. Los que defienden la injusticia y la desigualdad, están en retirada.', 'Acto por la Lucha Antiimperialista de los Pueblos VI Foro Social Mundial. Caracas, 27 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (350, 'Aceleremos la inversión y el desarrollo cultural; no hay revolución sin un impulso cultural pleno, grande, extendido en todo el país.', 'Conmemoración de los 7 años del gobierno del presidente Hugo Chávez Frías, Teatro Teresa Carreño, 2 de febrero de 2002', NULL);
INSERT INTO frases_chavez VALUES (355, '¡Unidad! ¡Unidad! ¡Unidad! Para salvar la patria, para salvar la revolución, para salvar el futuro.', 'Aló Presidente Nº 246, Cumaná, 5 febrero 2006', NULL);
INSERT INTO frases_chavez VALUES (357, 'Llamo a la unidad de todos los venezolanos para defender nuestra patria, nuestra soberanía y darle continuidad a este proyecto de transformación profunda.', 'Aló Presidente Nº 246, Cumaná, 5 febrero 2006', NULL);
INSERT INTO frases_chavez VALUES (359, 'Estamos atacando la pobreza y la miseria por distintas vías; sólo así podremos dar el gran salto adelante que necesitamos, enfrentando todos los problemas al mismo tiempo, siempre con la moral por delante.', 'Primer Gabinete Móvil Comunal, Teatro Teresa Carreño, 06 de Febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (360, 'Estamos librando una gran batalla política, de la cual depende la continuidad de nuestro proyecto nacional de desarrollo endógeno bolivariano.', 'Rendición de Cuentas de los Proyectos Comunitarios y Nuevos Proyectos en Conjunto, Teatro Teresa Carreño, 10 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (362, 'No debe haber sectarismo posible cuando se trata de un esfuerzo como el que estamos haciendo, en el cual lo importante es el colectivo mucho más que el protagonismo de alguien.', 'Juramentación de los ministros de Industrias Ligeras y Comercio, Agricultura y Tierras, Trabajo para la Economía Popular, Alimentación y Despacho de la Presidencia, Palacio de Miraflores, 24 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (365, 'La mayor parte de los medios de comunicación privados del mundo, pertenecen a élites que sólo defienden sus intereses y utilizan sus recursos como poderosos cañones de artillería contra la verdad.', 'Juramentación de nuevos embajadores, Palacio de Miraflores, 7 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (367, 'Hay que transformar el sistema, el modelo, porque no basta con el crecimiento, eso es un mito y una trampa; es la distribución de la riqueza la que hay que cambiar plenamente.', 'Rueda de prensa ofrecida por el Presidente Chávez y el Presidente electo de Bolivia, Evo Morales, Palacio de Miraflores, 3 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (368, 'El 2006 es el año de profundización de la estrategia del desarrollo integral endógeno, donde lo más importante es lo humano.', 'Aló Presidente Nº 243, Núcleo de Desarrollo Endógeno José Félix Ribas, Estado Aragua, 8 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (370, 'El pueblo debe controlar los poderes y crear herramientas para frenarlos cuando haya que frenarlos, cambiarlos cuando haya que cambiarlos, reestructurarlos cuando haya que reestructurarlos.', 'Presentación del Mensaje Anual a la Nación, Asamblea Nacional, 13 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (354, 'Recuerden, compatriotas: esta batalla va a ser muy dura, porque no estamos batallando contra los factores de la oposición política venezolana, no estamos batallando tampoco contra los medios de comunicación; ¡no!, realmente estamos enfrentando al imperio norteamericano.', 'Día de la dignidad y la Rebelión Bolivariana, Avenida Bolívar de Caracas. 4 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (363, 'Una Fuerza Armada que no esté en el corazón de un pueblo, está destinada al fracaso.', 'Aló Presidente Nro. 248, Municipio Acevedo, Estado Miranda; 5 de marzo de 2006', 'img/chavez/049.png');
INSERT INTO frases_chavez VALUES (373, 'Este planeta se salva por el camino de un nuevo socialismo que aquí estamos comenzando a construir.', 'Aló Presidente Nº 245, Parroquia Antímano, 29 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (374, 'Hoy tenemos una sociedad totalmente distinta a aquella de exclusión y privilegios, en la cual privatizaban la salud, la educación y los servicios públicos; en estos siete años, hemos borrado del mapa nacional la sola idea de la privatización de Venezuela.', 'Conmemoración de los 7 años del gobierno, del presidente Hugo Chávez Frías. Teatro Teresa Carreño, 2 de febrero de 2002', NULL);
INSERT INTO frases_chavez VALUES (375, 'La importancia de la organización comunitaria es que nos permitirá salir del individualismo.', 'Primer Gabinete Móvil Comunal, Teatro Teresa Carreño, 06 de Febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (377, 'Este proyecto nacional bolivariano va rumbo a un socialismo nuevo. No se trata de copiar nada, tenemos que inventar nuestro propio modelo de desarrollo.', 'Inauguración de la Universidad Iberoamericana del Deporte, San Carlos, 9 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (379, 'El socialismo es una corriente profundamente humanista; el capitalismo es inhumano.', 'Entrega de Certificados de Vivienda del Núcleo de Desarrollo Endógeno Habitacional “Patria Bolivariana” Maracaibo, 9 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (382, 'El Reino de Dios no es otro que el reino del socialismo verdadero, auténtico, un reino donde no haya clases sociales ni groseros privilegios.', 'Aló Presidente Nro. 247, Ciudad Guayana, 19 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (383, 'La revolución es un instrumento para lograr fines mayores: la independencia, el desarrollo integral, el progreso social, el desarrollo de una nueva sociedad.', 'Activación de la Planta Termoeléctrica “Pedro Camejo”, Valencia, Edo. Carabobo; 21 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (384, 'Tiene que haber una revolución política; tiene que haber una revolución económica también, pero la esencia de la Revolución es lo social, la conformación de una nueva sociedad.', 'Inauguración del Centro Médico de Diagnóstico, de Alta Tecnología “10 de Marzo”. La Guaira, 23 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (387, 'La causa esencial de la Revolución Bolivariana es buscar más y mejor nivel de vida para todos, en la lucha por instalar en Venezuela un nuevo sistema social, económico, político: el socialismo criollo, a lo venezolano.', 'Inauguración del Centro Médico de Diagnóstico de Alta Tecnología “10 de Marzo”. La Guaira, 23 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (390, 'Igualdad y libertad: raíces del socialismo que estamos planteando al mundo.', 'Aló Presidente N° 250, Valles del Tuy, 26 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (392, 'Nuestra lucha es por la integración suramericana, la integración latinoamericana. Sólo unidos seremos libres y podremos enfrentarnos a los gigantes del mundo; esta es una región del mundo que nació para ser grande y para ser libre.', 'Inicio del curso de Comando y Estado Mayor Conjunto e inicio de las actividades académicas militares. Teatro Teresa Carreño, 10 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (393, 'Somos absolutamente respetuosos de la soberanía de todos y cada uno de los países del mundo, particularmente de nuestros vecinos y hermanos; hermanos pueblos, hermanos países y hermanas repúblicas.', 'Presentación del Mensaje Anual a la Nación. Asamblea Nacional, 13 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (394, 'Hay que incorporar las grandes corrientes populares, campesinas, indígenas, de trabajadores, juventudes, estudiantes, militares, partidos políticos, parlamentos; hay que darle mayor fortaleza al nuevo Mercosur.', 'Llegada del Presidente Chávez al III Encuentro Trilateral Venezuela-Argentina-Brasil, Brasilia, 19 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (395, 'En la medida en que seamos más independientes, financiera y económicamente, podremos ayudarnos mucho mejor.', 'Declaraciones del Presidente Chávez, Brasilia, 19 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (399, 'Tengo la certeza de que ahora sí llegó la hora de nuestros pueblos, y cuando digo ahora, estoy pensando en este siglo XXI, el siglo de nuestra redención, nuestra unidad, nuestra independencia plena como Región, como pueblo grande, como Patria Grande.', 'Intervención en la entrega del Premio Internacional de la UNESCO “José Martí”, La Habana, 3 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (400, 'La integración a lo Bolívar, a lo Martí, sólo es posible con gobiernos de izquierda en América Latina.', 'Intervención en la entrega del Premio Internacional, de la UNESCO “José Martí”, La Habana, 3 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (380, 'El socialismo bolivariano y cristiano que estamos comenzando a construir, tiene que reivindicar el concepto hermoso del trabajo. El capitalismo le quita lo hermoso al trabajo y lo degenera en un mecanismo de explotación que convierte a los trabajadores en autómatas.', 'Acto con motivo de la entrega de pensiones de vejez, Palacio de Miraflores, 17 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (397, 'Nos dividieron para dominarnos y aplicarnos el modelo de explotación, dependencia y coloniaje.', 'Acto de Acuerdo Marco de Corresponsabilidad para la Transformación Industrial. Salón Venezuela del Círculo Militar, 20 de enero de 2006', 'img/chavez/079.png');
INSERT INTO frases_chavez VALUES (402, 'Están intentando aislar a Venezuela. ¡No podrán! Venezuela está acompañada, más que nunca antes en toda nuestra historia, por pueblos, gobiernos y movimientos populares y sociales.', 'Día de la dignidad y la Rebelión Bolivariana, Avenida Bolívar de Caracas, 4 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (404, 'Mercosur debe elaborar una estrategia de complementación de nuestras economías; continúa imperando la terrible voracidad capitalista de la competencia de los mercados, y por ese camino no vamos a ninguna parte.', 'Firma de Acuerdos entre la República Oriental del Uruguay y la República Bolivariana de Venezuela, Palacio de Miraflores, 14 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (406, 'Suramérica, con el petróleo que tenemos, con el gas que tenemos, con el pueblo que tenemos y la voluntad que debemos tener cada día más grande de integración, puede ser un polo petroquímico mundial, además de un polo agrícola mundial.', 'Conferencia de prensa de los presidentes, de Venezuela y Uruguay, Palacio de Miraflores, 14 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (407, '¡Nada ni nadie podrá evitar que nuestros pueblos recuperen la dignidad! ¡Nada ni nadie podrá evitar que la América Latina y el Caribe se enrumben hacia el destino superior que tienen señalado!', 'Inauguración del Centro Médico de Diagnóstico, de Alta Tecnología “10 de Marzo”. La Guaira, 23 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (412, 'Los pueblos romperemos el esquema impuesto en Naciones Unidas, para que haya de verdad naciones libres, hermanas y unidas, y no una dictadura contra la mayoría de los pueblos del mundo.', 'Juramentación del Ministro de Comunicación e Información y de los Embajadores ante la ONU y ante la República de Bolivia, Palacio de Miraflores, 28 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (413, 'Están volviendo los pueblos indígenas; los más oprimidos de esta tierra se han levantado y están comenzando a construir una nueva página de la historia de la América Latina y el Caribe, luego de siglos de explotación, dominación y atraso.', 'Inauguración de La Central Hidroeléctrica Caruachi, estado Bolívar; 31 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (418, 'Hoy estamos viviendo los resultados crudos, dolorosos, de la imposición del llamado ‘consenso de Washington’: nunca hubo tanta miseria en América Latina, nunca hubo tanta diferencia entre una minoría enriquecida y una mayoría empobrecida.', 'Acto de Acuerdo Marco de Corresponsabilidad para la Transformación Industrial, Salón Venezuela del Círculo Militar, 20 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (420, 'Todos debemos unirnos, articularnos, en una ofensiva victoriosa contra el imperialismo.', 'Acto por la Lucha Antiimperialista de los Pueblos VI Foro Social Mundial, Caracas, 27 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (427, 'La actitud imperialista, genocida y fascista del presidente de los Estados Unidos no tiene límites. Yo creo que Hitler sería un niño de pecho delante de George W. Bush.', 'Día de la dignidad y la Rebelión Bolivariana, Avenida Bolívar de Caracas. 4 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (416, 'La única guerra posible para nosotros, sería aquella que estaríamos obligados a hacer contra una invasión del imperialismo norteamericano. Para esa guerra tenemos que prepararnos desde el alma, desde las raíces de Guaicaipuro, Miranda, Bolívar, Zamora, desde la grandeza de nuestra historia, nuestros mártires, nuestro pueblo.', 'Intervención en el inicio del curso de Comando y Estado Mayor Conjunto, Teatro Teresa Carreño, 10 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (422, 'Debemos seguir tres grandes líneas estratégicas: la primera, el fortalecimiento del poder militar de la nación; la segunda, la unión cívico-militar; y la tercera, la incorporación masiva del pueblo a las tareas del pensamiento, la capacitación y el adiestramiento para la defensa nacional.', 'Desfile cívico-militar en ocasión del séptimo aniversario del Gobierno Bolivariano, Patio de Honor de la Academia Militar, 2 de febrero de 2006', 'img/chavez/049.png');
INSERT INTO frases_chavez VALUES (424, 'Es imprescindible, para que podamos ser verdaderamente libres y para que podamos volar unidos en libertad e igualdad, que caiga ese imperio y se levante nuestro imperio, que es el imperio de la justicia, la igualdad, la razón, la verdad, las ideas y las luces.', 'Intervención en la entrega del Premio Internacional, de la UNESCO “José Martí”, La Habana, 3 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (403, 'La alianza entre Cuba y Venezuela sí es un peligro: para el analfabetismo, las enfermedades, la pobreza y la miseria; un peligro para el dominio imperialista.', 'Acto con motivo de la entrega de pensiones de vejez, Palacio de Miraflores, 17 de febrero de 2006', 'img/chavez/107.png');
INSERT INTO frases_chavez VALUES (417, 'Hemos puesto en marcha una nueva doctrina militar en Venezuela: la guerra de todo el pueblo. Si aquí vienen a meterse con nosotros, no será sólo con los militares venezolanos, será con todo un pueblo, será con todo un país dispuesto a defender la sagrada soberanía de nuestro territorio.', 'Presentación del Mensaje Anual a la Nación Asamblea Nacional, 13 de enero de 2006', 'img/chavez/049.png');
INSERT INTO frases_chavez VALUES (421, 'Tenemos que seguir sacándonos el demonio de la infiltración y la alienación del imperialismo. Sus manuales y su doctrina no es nuestra; la doctrina de ellos es imperialista, la nuestra es libertadora. Ellos nacieron para la dominación del mundo, nosotros nacimos para la libertad.', 'Conmemoración de los 7 años del gobierno del presidente Hugo Chávez Frías,  Teatro Teresa Carreño, 2 de febrero de 2002', 'img/chavez/125.png');
INSERT INTO frases_chavez VALUES (431, '¡Tendrían que pasar por encima de los cadáveres de millones de venezolanos para poder esclavizar de nuevo la patria libre de Bolívar!', 'Día de la dignidad y la Rebelión Bolivariana, Avenida Bolívar de Caracas. 4 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (432, 'No le tenemos miedo al imperialismo norteamericano; y eso nos hace libres.', 'Aló Presidente N° 246. Cumaná, 5 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (437, 'El imperialismo norteamericano nos ve como seres inferiores, como su patio trasero y como sus esclavos. Pues no lo somos, ¡somos libres y seremos libres!.', 'Declaraciones del presidente Chávez luego de la reunión con el primer ministro de Granada, Keith Mitchell, Palacio de Miraflores, 16 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (444, 'Así como defendía a mis soldados cuando era responsable de mi tropa, hoy defiendo con fiereza la dignidad del gran escuadrón que es el pueblo venezolano.', 'Aló Presidente Nro. 249, Elorza, estado Apure; 19 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (445, 'Este es el siglo del fin del imperialismo norteamericano, estoy absolutamente seguro de que el imperio norteamericano no pasará de este siglo; ¡a todo cochino le llega su sábado, a todo imperio le llega su siglo!', 'Inauguración de La Central Hidroeléctrica Caruachi, estado Bolívar; 31 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (460, 'La tierra es la madre: es allí donde están todos los recursos para levantar a un país, para la vida en común de un pueblo.', 'Aló Presidente Nro. 249, Elorza, estado Apure; 19 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (434, 'Vamos a demostrarle una vez más al imperio norteamericano y a la gente que le sirve, que nosotros somos soberanos y libres, y que vamos a seguir siéndolo. Pero para ello se requiere de mucha fuerza unitaria, conocimiento, moral, conciencia, entendimiento y acción conjunta de trabajo.', 'Primer Gabinete Móvil Comunal Teatro Teresa Carreño, 6 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (439, 'Levantemos el espíritu nacionalista y mantengámonos alerta. Incrementemos la organización popular, la conciencia política, la unidad del pueblo y el trabajo para fortalecer aún más el país y continuar resistiendo y derrotando las agresiones del imperialismo.', 'Acto con motivo de la entrega de pensiones de vejez, Palacio de Miraflores, 17 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (457, 'Ratifico mi admiración por las mujeres venezolanas, por las mujeres que luchan, batallan e imprimen pasión y amor a todo lo que hacen; sobre todo por esa legión de mujeres que hoy batallan por la liberación definitiva de Venezuela, de nuestra madre Patria, de la gran mujer que es Venezuela.', 'Primer Encuentro Nacional de la Red Popular de Usuarias del Banco de Desarrollo de la Mujer Círculo Militar, 7 de marzo de 2006', 'img/chavez/126.png');
INSERT INTO frases_chavez VALUES (459, 'El día que las mujeres compartan con igual peso que los hombres la conducción de nuestros pueblos, el mundo empezará a enderezarse.', 'Conferimiento del Doctorado Honoris Causa de la Universidad Mayor de San Andrés, y medalla “Mariscal Andrés de Santa Cruz” al presidente Chávez, La Paz, 23 de enero de 2006', 'img/chavez/010.png');
INSERT INTO frases_chavez VALUES (458, 'Siempre he creído que uno de los grandes males del capitalismo es la exclusión a la mujer, la minimización del gran potencial que tiene la mujer para desempeñarse en cualquier tarea, por más dura y por más exigente que sea.', 'Juramentación de los ministros de Industrias Ligeras y Comercio, de Agricultura y Tierras, del Trabajo, para la Economía Popular, de Alimentación, y del Despacho de la Presidencia de la República, Palacio de Miraflores, 24 de febrero de 2006', 'img/chavez/007.png');
INSERT INTO frases_chavez VALUES (441, '¡Pensamiento antiimperialista! ¡Pensamiento de resistencia! ¡Pensamiento nacionalista!: he allí las fuertes corrientes del pensamiento militar venezolano.', 'Aló Presidente Nº 248, Municipio Acevedo, estado Miranda, 5 de marzo de 2006', 'img/chavez/049.png');
INSERT INTO frases_chavez VALUES (443, 'Con la fuerza de la verdad, que es la fuerza más grande, junto al amor, la dignidad y la moral, venceremos los atropellos imperiales.', 'Juramentación de nuevos embajadores, Palacio de Miraflores, 7 de marzo de 2006', 'img/chavez/107.png');
INSERT INTO frases_chavez VALUES (464, 'Un representante debe ser un eminente educador.', 'Participación del inicio del nuevo período de sesiones ordinarias 2006 y presentación de la nueva Junta Directiva de la Asamblea Nacional al Poder Ejecutivo, Palacio Blanco, 6 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (466, 'La unión de una gran hermandad nacional, el espíritu y el orgullo de ser venezolanos, nos impulsarán hacia la grandeza de la Patria.', 'Aló Presidente Nº 243 Núcleo de Desarrollo Endógeno José Félix Ribas, estado Aragua, 8 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (467, 'Nos asisten la moral y la verdad, y contra eso nadie puede.', 'Presentación del Mensaje Anual a la Nación, Asamblea Nacional, 13 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (468, 'Una de las grandes batallas de la Revolución es la revolución moral, para reinstalar los valores y la dignidad del ser humano.', 'Presentación oficial de la Misión Negra Hipólita, Teatro Teresa Carreño, 14 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (469, 'El pueblo se ha convertido en el primer maestro de la República.', 'Aló Presidente Nº 244, Palacio de Miraflores, 15 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (470, 'Sólo unidos lograremos la Patria que soñamos, la Patria que dejaremos a nuestros hijos.', 'Acto de Acuerdo Marco de Corresponsabilidad para la Transformación Industrial, Salón Venezuela del Círculo Militar, 20 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (471, 'Educación para la liberación es lo que necesitamos.', 'Conferimiento del Doctorado Honoris Causa de la Universidad Mayor de San Andrés, y medalla “Mariscal Andrés de Santa Cruz” al presidente Chávez. La Paz, 23 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (472, 'Llegamos aquí para hacer una revolución o morir en el camino; no hay más alternativa para nosotros.', 'Aló Presidente Nº 245 Parroquia Antímano, 29 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (473, 'Cuando a una idea le llega su época y anida en un espacio, se convierte en la fuerza más poderosa que pueda existir. Creo que, sencillamente, a la idea de la transformación, la vida y la Revolución le llegó su época y su espacio en Venezuela.', 'Conmemoración de los siete años del Gobierno del presidente Hugo Chávez Frías. Teatro Teresa Carreño, 2 de febrero de 2002', NULL);
INSERT INTO frases_chavez VALUES (475, 'Siempre he pensado que el hombre individual muy poco pudiera hacer si no hay una circunstancia, si no hay otros hombres, otras mujeres; si no hay esa fuerza de un pueblo que a uno lo lleva, lo motiva, lo obliga y le aclara el camino.', 'Intervención en la entrega del Premio Internacional de la UNESCO “José Martí”, La Habana, 3 de febrero de 2006', NULL);
INSERT INTO frases_chavez VALUES (480, 'La democracia requiere de un pueblo ilustrado.', 'Aló Presidente Nº 246, Cumaná, 5 febrero 2006', NULL);
INSERT INTO frases_chavez VALUES (483, 'A Venezuela le ha correspondido, comenzando el siglo XXI, tomar la vanguardia en la construcción de un mundo nuevo.', 'Activación de la Planta Termoeléctrica “Pedro Camejo” Valencia, Edo. Carabobo; 21 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (484, 'El Gobierno Revolucionario no descansará, no descansaré yo en lo personal, hasta que no nos acerquemos a niveles superiores de felicidad posible.', 'Inauguración del Centro Médico de Diagnóstico de Alta Tecnología “10 de Marzo”. La Guaira, 23 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (485, 'Mi vida es de ustedes, no me pertenece, es del pueblo venezolano; así estaremos abrazados hasta el fin de nuestros días, hasta el fin de nuestros tiempos.', 'Aló Presidente N° 250, Valles del Tuy, 26 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (487, 'La unión de una gran hermandad nacional, el espíritu y el orgullo de ser venezolanos, nos impulsarán hacia la grandeza de la Patria.', 'Programa ALÓ PRESIDENTE Nº 243, Núcleo de Desarrollo Endógeno José Félix Ribas, Estado Aragua, 8 de enero de 2006', NULL);
INSERT INTO frases_chavez VALUES (490, 'Qué triste sería, ¡por el amor de Dios!, que desperdiciemos esta maravillosa oportunidad que nos ha dado Dios, nuestra historia, el despertar de nuestros pueblos.', 'Firma de Acuerdos entre la República Oriental del Uruguay y la República Bolivariana de Venezuela, Palacio de Miraflores, 14 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (474, '¡Implacables tenemos que ser con los traidores!', 'Desfile civicomilitar en ocasión del séptimo aniversario del Gobierno Bolivariano, Patio de Honor de la Academia Militar, 2 de febrero de 2006', 'img/chavez/125.png');
INSERT INTO frases_chavez VALUES (491, 'Si el proyecto de aquellos hombres y aquellas mujeres se hubiese concretado hace 200 años, sin duda que otra sería la historia de ésta nuestra América, de esta Patria Grande. Lo cual, además de ser una reflexión histórica, no deja de ser un compromiso que hoy latiguea el alma, que hoy compromete, que hoy impulsa.', 'Firma de Acuerdos entre la República Oriental del Uruguay y la República Bolivariana de Venezuela. Palacio de Miraflores, 14 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (492, 'Cada día debemos ser civiles y militares, más revolucionarios. Hay que revolucionarse por dentro: en los valores espirituales y morales. Un verdadero revolucionario, por ejemplo, no anda buscando beneficio económico alguno, ¡no!: un verdadero revolucionario está pendiente del buen vivir del colectivo.', 'Activación de la Planta Termoeléctrica “Pedro Camejo”, Valencia, Edo. Carabobo; 21 de marzo de 2006', 'img/chavez/021.png');
INSERT INTO frases_chavez VALUES (463, 'El primer gran poder es el poder moral.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (493, 'Lo primero que pretendieron hacer los golpistas del 2002 fue eliminar la Constitución, porque esta Constitución es como la Cruz de Cristo ante el demonio: el demonio es el neoliberalismo y el imperialismo, y esta Constitución soberana, hecha, discutida y aprobada por nuestro pueblo, le pone fin al proyecto neoliberal de entrega y de saqueo al país.', 'Activación de la Planta Termoeléctrica “Pedro Camejo”, Valencia, Edo. Carabobo; 21 de marzo de 2006', 'img/chavez/073.png');
INSERT INTO frases_chavez VALUES (479, 'Somos soldados de la paz; luchamos por ella, por la igualdad y la justicia.', 'Develación de la estatua del ciudadano Pedro Velásquez. Patio de Armas de la Academia Militar de Venezuela, 15 de febrero de 2006', 'img/chavez/021.png');
INSERT INTO frases_chavez VALUES (478, 'Fortalezcamos la salud mental, la salud corporal, la salud espiritual de la nación, a través del deporte y la cultura; eso es algo fundamental: un pueblo que no hace deporte está condenado al fracaso.', 'Inauguración de la Universidad Iberoamericana del Deporte. San Carlos, 9 de febrero de 2006', 'img/chavez/061.png');
INSERT INTO frases_chavez VALUES (494, 'Tenemos que salvar la vida en este planeta. Debemos salvar al mundo de los desastres de la guerra, de los desastres de la miseria -que es una forma de guerra-, de los desastres de la explotación de unas minorías contra mayorías.', 'Activación de la Planta Termoeléctrica “Pedro Camejo”, Valencia, Edo. Carabobo; 21 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (496, 'Nuestro liderazgo es colectivo y no depende de un hombre. Hay un líder, por supuesto, pero hay una masa de líderes entregados a este proyecto en alma, nervio y corazón.', 'Aló Presidente N° 250 Valles del Tuy, 26 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (501, 'El poder del pueblo es el más grande de los poderes, después del poder de Dios.', 'Inicio de la Misión Madres del Barrio y entrega de asignaciones económicas a amas de casa, Teatro Municipal de Caracas, 30 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (503, 'Estamos en un horizonte donde se aprecian las luces de un amanecer: estamos saliendo de la noche, está amaneciendo en esta tierra, es tiempo de resurrección, es tiempo de un nuevo despertar, de un nuevo mundo, de una nueva patria.', 'Inicio de la Misión Madres del Barrio y entrega de asignaciones económicas a amas de casa, Teatro Municipal de Caracas, 30 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (510, 'No tengo nada contra los periodistas; soy crítico al manejo de los medios, y ustedes, periodistas, deberían ser los primeros críticos, en aras de la libertad de expresión y el balance comunicacional.', 'Activación de la Planta Termoeléctrica “Pedro Camejo”, Valencia, Edo. Carabobo; 21 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (512, 'Nos habían impuesto un proyecto exógeno, subordinado a los poderes trasnacionales; ahora esto es un proyecto que se fundamenta en el poder nacional, aún cuando trasciende los limites de nuestro territorio.', 'Aló Presidente N° 250, Valles del Tuy, 26 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (516, 'Hay que ganar tiempo en la preparación de la organización popular y la unión entre todos los factores revolucionarios.', 'Aló Presidente N° 250, Valles del Tuy, 26 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (517, 'Quien pretenda llevar adelante un proyecto de transformación, inevitablemente, más temprano que tarde, chocará con el imperio norteamericano; el choque es necesario, así lo creo, porque el choque define.', 'Juramentación del Ministro de Comunicación e Información y de los Embajadores ante la ONU y ante la República de Bolivia, Palacio de Miraflores, 28 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (518, 'Los pueblos romperemos el esquema impuesto en Naciones Unidas, para que haya de verdad naciones libres, hermanas y unidas, y no una dictadura contra la mayoría de los pueblos del mundo.', 'Juramentación del Ministro de Comunicación e Información y de los Embajadores ante la ONU y ante la República de Bolivia, Palacio de Miraflores, 28 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (520, 'Un pueblo ilustrado es instrumento hermoso de su propia liberación.', 'Inicio de la Misión Madres del Barrio, Teatro Municipal de Caracas, 30 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (521, '¡En Venezuela jamás se privatizarán los recursos energéticos! El Estado tiene que garantizar a la Nación la propiedad de estos recursos vitales.', 'Inauguración de La Central Hidroeléctrica Caruachi, estado Bolívar; 31 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (495, 'El socialismo es lo que propone Jesús, el Cristo Redentor: vayamos iguales, como hermanos; que reine el amor entre nosotros y no el odio y la envidia; rechacemos el individualismo y sigamos el colectivismo; vivamos en comunidad, respetando los derechos de todos.', 'Inauguración del Centro Médico de Diagnóstico de Alta Tecnología “10 de Marzo”, La Guaira, 23 de marzo de 2006', 'img/chavez/064.png');
INSERT INTO frases_chavez VALUES (499, 'Este tiempo de paz, como síntesis y culminación, es el que ha estado forjando nuestro pueblo. Este tiempo de paz debería unirnos a todos los venezolanos, a todas las venezolanas, sobre todo para aislar definitivamente a las minorías que aún quieren que prevalezca el tiempo de la guerra, el odio y la destrucción.', 'Bienvenida a Su Excelencia Jorge Cardenal Urosa Savino, Maiquetía, 30 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (511, 'Desde el punto de vista de nuestra generación y la de nuestros hijos, pudiera ser válido decir: ‘es ahora o nunca’ el tiempo para diseñar una estrategia victoriosa para salir del atraso, la dependencia, el subdesarrollo y la miseria. Tenemos una gran oportunidad delante de nosotros, al alcance de nuestras manos.', 'Seminario Internacional de Integración Financiera en América Latina y el Caribe. Banco Central de Venezuela, 24 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (497, 'Venezuela necesita de la plena recuperación del sentido eclesiástico, de lo que significa vivir en cristiandad; el genuino sentido eclesiástico está más allá del demonio del individualismo y los intereses egoístas, obra en función del fortalecimiento permanente de la comunidad, haciendo suya la opción preferencial por los pobres que nos enseñó Cristo.', 'Bienvenida al Cardenal Jorge Urosa Savino, Maiquetía, 30 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (505, 'Pedimos a Dios por la paz. Cualquier diferencia que haya en el mundo entre los países, debemos solucionarla siempre por la vía diplomática.', 'Inauguración de La Central Hidroeléctrica Caruachi, estado Bolívar; 31 de marzo de 2006', 'img/chavez/096.png');
INSERT INTO frases_chavez VALUES (506, 'Mi respeto a la Santa Iglesia Católica, Apostólica y Romana, de la cual soy miembro activo y batallador desde los tiempos de mi infancia.', 'Bienvenida a Su Excelencia Jorge Cardenal Urosa Savino, Maiquetía, 30 de marzo de 2006', 'img/chavez/064.png');
INSERT INTO frases_chavez VALUES (523, 'No es incompatible un proyecto nacionalista, revolucionario, como el que en Venezuela está en marcha, y la presencia de dignas empresas internacionales y del sector privado nacional.', 'Firma de acuerdos para la migración de los convenios operativos a las empresas mixtas. Palacio de Miraflores, 31 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (6, 'Rendimos tributo al pensamiento de Bolívar: Pensamiento antiimperialista, Pensamiento revolucionario, Pensamiento fundamental para construir la Patria Bolivariana.', 'Aló Presidente Nº 255. Ciudad Guayana, Estado Bolívar; 21 de mayo de 2006.', 'img/chavez/006.png');
INSERT INTO frases_chavez VALUES (461, 'El líder verdadero es un gran educador cívico, moral y político; un conductor.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (5, 'El pueblo venezolano ha resucitado a Simón Bolívar, que se paró y anda de nuevo por estas tierras y por estos pueblos.', 'Hugo Rafael Chávez Frías', 'img/chavez/005.png');
INSERT INTO frases_chavez VALUES (8, '¡Nadie detendrá la marcha victoriosa de la Patria de Simón Bolívar!', 'Hugo Rafael Chávez Frías', 'img/chavez/008.png');
INSERT INTO frases_chavez VALUES (245, 'El ALBA es un mecanismo que está en marcha, y que está causando escozor en el imperio norteamericano y sus la cayos en el continente.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (129, 'Como la nube a la tormenta, el capitalismo lleva dentro de sí la muerte.', 'Hugo Rafael Chávez Frías', 'img/chavez/129.png');
INSERT INTO frases_chavez VALUES (132, 'Invito a todos a que caminemos, sin temores de ningún tipo y sin pausa alguna, hacia la consolidación de las estructuras del nuevo Estado social, de derecho y de justicia; avanzando en la conformación del socialismo del siglo XXI en Venezuela.', 'Hugo Rafael Chávez Frías', 'img/chavez/132.png');
INSERT INTO frases_chavez VALUES (133, 'El capitalismo lo que quiere es vender, y utiliza a la mujer como un objeto sexual, esa es una de las causas de la demolición de los valores.', 'Hugo Rafael Chávez Frías', 'img/chavez/133.png');
INSERT INTO frases_chavez VALUES (137, 'Sólo a través del socialismo podremos vencer las rémoras del egoísmo, el consumismo, el odio y la violencia.', 'Hugo Rafael Chávez Frías', 'img/chavez/137.png');
INSERT INTO frases_chavez VALUES (299, 'Es fundamental para el proyecto nacional la ciencia y la tecnología. Hay que aplicar la ciencia y la tecnología en todas las cosas, por más sencillas que sean.', 'Hugo Rafael Chávez Frías', 'img/chavez/115.png');
INSERT INTO frases_chavez VALUES (302, 'La democracia de élites, representativa, es contrarrevolucionaria. Un Gobierno tomando decisiones encerrado en cuatro paredes, expropiándole al pueblo su soberanía, es contrarrevolucionario.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (305, 'Las sociedades liberales muchas veces son manipuladas por una supuesta libertad de expresión detrás de la cual se esconden intereses de dominación.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (396, 'Caracas-Brasilia-Buenos Aires: el ‘Eje del Sur’, es la columna vertebral, uno de los ejes fundamentales del proceso de conformación de la unidad de Suramérica.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (398, 'La batalla del conocimiento, la batalla de la conciencia, la batalla de las ideas, debemos arreciarla; eso es fundamental para la liberación, la integración, la unión verdadera de nuestros pueblos; para la salvación del mundo, incluso un deber.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (388, 'La economía debe estar al servicio de la política: hay que politizar la economía y también hay que socializar la política, ya que ésta debe colocar por delante los grandes intereses de la sociedad.', 'Seminario Internacional de Integración Financiera en América Latina y el Caribe, Banco Central de Venezuela, 24 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (410, 'Muchas cosas podemos lograr en beneficio del desarrollo de nuestros pueblos; si algún continente tiene fuerza propia para dar ese gran salto hacía un modelo propio de desarrollo social, humano, económico, productivo, político, democrático, es la América Latina, incluyendo, por supuesto, al Caribe.', 'Seminario Internacional de Integración Financiera en América Latina y el Caribe, Banco Central de Venezuela, 24 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (522, 'Estamos dispuestos a acompañar a los pueblos hermanos de América Latina y el Caribe en su esfuerzo, porque sólo nosotros, fronteras adentro, no lograremos nuestras metas; de ahí nuestro empeño, nuestra voluntad suprema en continuar abriendo los caminos a una verdadera integración.', 'Inauguración de La Central Hidroeléctrica Caruachi, estado Bolívar; 31 de marzo de 2006', NULL);
INSERT INTO frases_chavez VALUES (524, 'Ser rico es malo, es inhumano. Así lo digo y condeno a los ricos.', 'Abril de 2005 a empresarios venezolanos.', NULL);
INSERT INTO frases_chavez VALUES (525, 'ALCA, ALCA, ¡al carajo!...', 'Noviembre de 2005. III cumbre de los Pueblos en Argentina.', NULL);
INSERT INTO frases_chavez VALUES (526, 'Creo que estamos sufriendo de impotencia política. Necesitamos un viagra político.', 'Diciembre del 2006 en la II Cumbre sudamericana de naciones en Bolivia.', NULL);
INSERT INTO frases_chavez VALUES (527, 'Por Cristo, el más grande socialista de la historia, por todos los dolores, por todos los amores, por todas las esperanzas que haré cumplir con los mandatos supremos de esta maravillosa Constitución aun a costa de mi propia vida. Patria, socialismo o muerte.', 'Enero de  2007, toma de posesión de su nuevo mandato constitucional.', NULL);
INSERT INTO frases_chavez VALUES (528, 'Tú [Fidel Castro], forjador de historia, maestro, yo lo digo sin complejos, tú eres padre de los revolucionarios de este continente, tu eres el padre nuestro.', 'Octubre de  2007 al cdte. Fidel Castro', NULL);
INSERT INTO frases_chavez VALUES (529, 'Tenemos 500 años aquí y nunca nos callaremos, mucho menos ante un monarca.', '10 de noviembre de 2007, tras el "¿Por qué no te callas?" que le dijo el rey de España.', NULL);
INSERT INTO frases_chavez VALUES (530, 'Váyanse al carajo yanquis de mie*** que aquí hay un pueblo digno. Váyanse al carajo cien veces. Aquí estamos los hijos de Bolívar, los hijos de Guaicaipuro, los hijos de Túpac Amaru y estamos resueltos a ser libres.', 'Septiembre de 2008 al momento de expulsar al embajador de Estados Unidos.', NULL);
INSERT INTO frases_chavez VALUES (531, 'El Papa no es ningún embajador de Cristo en la tierra, como ellos dicen. ¡Por el amor de Dios! ¿Qué cosa es esa? Embajador de Cristo. Cristo no necesita embajador, Cristo está en el pueblo.', 'Julio de 2010 al Papa Benedicto XVI.', NULL);
INSERT INTO frases_chavez VALUES (10, 'El Che Guevara está siempre con nosotros, vivo en el recuerdo y en el alma de nuestros pueblos.', 'Hugo Rafael Chávez Frías', 'img/chavez/010.png');
INSERT INTO frases_chavez VALUES (11, '¡Es mentira la tesis del descubrimiento de América! ¡Fue realmente una colonización y una invasión que arrasó con nuestra civilización aborigen!', 'Hugo Rafael Chávez Frías', 'img/chavez/011.png');
INSERT INTO frases_chavez VALUES (533, '¡Hasta la vida siempre! ¡Viviremos y Venceremos!', '10 de Diciembre de 2012. Al partir a su último viaje a Cuba.', NULL);
INSERT INTO frases_chavez VALUES (7, '¿Quién convocó el Congreso Anfictiónico? Bolívar. ¿Desde dónde lo convocó? Desde Lima. ¿Cuándo lo convocó? Dos días antes de la Batalla de Ayacucho. Fue como una premonición de Bolívar, porque Bolívar tenía el don de la gran estrategia.', 'Conferencia de prensa del presidente Chávez con medios nacionales y corresponsales, en el marco de los acuerdos del ALBA. Palacio de Miraflores, 24 de mayo de 2006.', 'img/chavez/007.png');
INSERT INTO frases_chavez VALUES (9, 'En el 2026, a doscientos años del Congreso de Panamá, debe ser una realidad la integración plena de nuestra América, la conformación del bloque político, libre y de iguales. ¿Es posible? ¡Claro que es posible!', 'Firma de acuerdos, convenios y memorandos de entendimiento en el marco del ALBA y el TCP. Palacio de Gobierno de La Paz, Bolivia; 26 de mayo de 2006.', 'img/chavez/009.png');
INSERT INTO frases_chavez VALUES (14, 'Gloria eterna a Antonio José de Sucre, el Gran Mariscal de Ayacucho. Te lloramos, pero te reivindicamos; te lloramos, pero elevamos tu antorcha, que hoy está más viva que nunca.', 'Aló Presidente N° 257. Parque Nacional El Ávila, 4 de junio de 2006.', 'img/chavez/014.png');
INSERT INTO frases_chavez VALUES (16, 'El socialismo robinsoniano es una de las más poderosas raíces del nuevo socialismo del siglo XXI que hemos comenzado a construir en Venezuela.', 'Entrega de titularidad a docentes del estado Zulia. Plaza de Toros Monumental de Maracaibo, 10 de junio de 2006.', 'img/chavez/016.png');
INSERT INTO frases_chavez VALUES (17, 'Debemos dedicarnos por entero en mente, cuerpo, alma y espíritu, para que la historia que estamos escribiendo sea distinta.', 'Aló Presidente Nº 258. Villa Bruzual, estado Portuguesa; 11 de junio de 2006.', 'img/chavez/017.png');
INSERT INTO frases_chavez VALUES (18, '¡Con nosotros no van a poder! ¡En Venezuela están las cenizas de Simón Bolívar, las cenizas de nuestros abuelos, las cenizas de Guaicaipuro! ¡Tendrían que aniquilarnos a todos nosotros para adueñarse de esta tierra!', 'Entrega de fusiles de asalto Kalashnikov AK-103. Patio de Honor del Ministerio de la Defensa. 14 de junio de 2006', 'img/chavez/018.png');
INSERT INTO frases_chavez VALUES (22, '¡Que la Revolución se siembre hasta lo más profundo de la tierra venezolana y en la conciencia de los venezolanos!, ¡pueblo revolucionario!, ¡pueblo heroico!, ¡pueblo grande!', 'Alo Presidente N° 251. Hato San Pablo Paeño, estado Apure; 2 de abril de 2006.', 'img/chavez/022.png');
INSERT INTO frases_chavez VALUES (24, 'Estamos abriendo los caminos iniciales de la primera etapa de una Revolución que trascenderá este siglo, para bien de Venezuela y para hacer realidad un mundo distinto, un mundo mejor.', 'Declaraciones del presidente Chávez durante la inauguración de Aldeas Universitarias 5 de abril de 2006', 'img/chavez/024.png');
INSERT INTO frases_chavez VALUES (25, 'Toda revolución requiere nacimientos y renacimientos, muerte y parto; parto permanente de lo nuevo, muerte permanente de lo corrupto y podrido.', 'Aló Presidente N° 252. Campo de Carabobo, 9 de abril de 2006.', 'img/chavez/025.png');
INSERT INTO frases_chavez VALUES (26, '¡Quien de verdad esté conmigo tiene que ser capaz de morir por el pueblo y por la Patria!', 'Aló Presidente N° 252. Campo de Carabobo, 9 de abril de 2006.', 'img/chavez/026.png');
INSERT INTO frases_chavez VALUES (28, 'Las revoluciones logran cosas que parecían imposibles.', 'Primer Encuentro Nacional de Estudiantes de la Universidad Bolivariana de Venezuela. Punto Fijo, 18 de abril de 2006.', 'img/chavez/028.png');
INSERT INTO frases_chavez VALUES (30, 'La Revolución Bolivariana es sobre todo humanista, yo siempre digo ‘cristiana’, porque Cristo vino a enseñarnos esto: la humanidad y la justicia.', 'Aló Presidente Nº 253. El Tigre, estado Anzoátegui; 23 de abril de 2006.', 'img/chavez/030.png');
INSERT INTO frases_chavez VALUES (32, 'Esta Revolución tiene que ser cada día más humana, y dentro de lo humano, cada día más cristiana. Amándonos los unos a los otros lograremos tener Patria libre y grande y hacer una Revolución profunda.', 'Rueda de prensa entre el presidente Hugo Chávez y el presidente electo de la República de Haití, René Preval. Palacio de Miraflores, 24 de abril de 2006.', 'img/chavez/032.png');
INSERT INTO frases_chavez VALUES (12, 'Los pueblos de la América India estamos llamados a reencontrarnos con nuestras raíces para reconstituir nuestra propia alma, nuestra propia esencia, y lanzarnos hacia un futuro en igualdad y libertad.', 'Hugo Rafael Chávez Frías', 'img/chavez/012.png');
INSERT INTO frases_chavez VALUES (19, '¡Esta Revolución no tiene derecho a fracasar!', 'Hugo Rafael Chávez Frías', 'img/chavez/019.png');
INSERT INTO frases_chavez VALUES (532, 'Más fácil será que un burro pase por el ojo de una aguja a que esta oposición le gane a Chávez unas elecciones.', 'Octubre de 2011, sobre las elecciones presidenciales en Venezuela.', 'img/chavez/109.png');
INSERT INTO frases_chavez VALUES (39, 'Hagamos una batalla por la justicia y vendrá la paz entre nosotros.', 'Hato San Pablo Paeño, estado Apure; 2 de abril de 2006.', 'img/chavez/039.png');
INSERT INTO frases_chavez VALUES (41, 'Dentro del proyecto nacional de desarrollo, necesitamos una política científica nacional, y estamos desarrollándola; de allí la Misión Ciencia y las Aldeas Universitarias.', 'Inauguración de Aldea Universitarias Turmero, estado Aragua 4 de abril de 2006.', 'img/chavez/041.png');
INSERT INTO frases_chavez VALUES (42, 'Debemos impulsar un gran movimiento estudiantil, protestatario, consciente, con nuevas formas de organización adecuadas al siglo XXI, de verdadera democracia, que rompa con el enclaustramiento para alcanzar la verdadera autonomía universitaria.', 'Primer Encuentro Nacional de Estudiantes de la Universidad Bolivariana de Venezuela. Punto Fijo, 18 de abril de 2006.', 'img/chavez/042.png');
INSERT INTO frases_chavez VALUES (43, 'En Venezuela, más pronto que tarde, no habrá un solo niño en la calle, ni un indigente, ni una familia abandonada. ¡Eso debe ser objetivo supremo de nuestra Revolución!', 'Acto con motivo del III Aniversario de la Misión Barrio Adentro. Teatro Municipal de Caracas, 21 de abril de 2006.', 'img/chavez/043.png');
INSERT INTO frases_chavez VALUES (46, 'Queremos que el petróleo venezolano sirva para la paz y para el amor, para sacar de la miseria a tanta gente.', 'Aló Presidente N° 253. Campo Oficina, municipio Simón Rodríguez, El Tigre, estado Anzoátegui; 23 de abril de 2006.', 'img/chavez/046.png');
INSERT INTO frases_chavez VALUES (47, '¡Quiero al pueblo de los Estados Unidos igual que quiero al pueblo venezolano!... creo que tenemos el mismo destino.', 'Conversatorio con autoridades y representantes del programa de combustible para calefacción a bajo costo para los pobres en Estados Unidos. Palacio de Miraflores; 24 de abril de 2006.', 'img/chavez/047.png');
INSERT INTO frases_chavez VALUES (49, 'A la juventud venezolana: iluminen el camino de este pueblo y sean sal para acabar con la corrupción moral, con la corrupción material y con la corrupción de los valores.', 'Entrega de becas y relanzamiento de la Fundación Gran Mariscal de Ayacucho. Teatro Teresa Carreño, 2 de mayo de 2006.', 'img/chavez/049.png');
INSERT INTO frases_chavez VALUES (51, '¡No me cabe en el pecho el amor que siento por este pueblo! ¡Me desborda de pasión y de fuerza!', 'Primer Encuentro Nacional de Cajas Rurales 2006. Complejo de Eventos Bellas Artes, estado Lara. 5 de mayo de 2006.', 'img/chavez/051.png');
INSERT INTO frases_chavez VALUES (52, 'Hay que recuperar los valores de la solidaridad y el amor entre nosotros, y no la envidia, el odio y el individualismo.', 'Inauguración de la Fase I del Acueducto Chirgua-El Cercado. Estación de Bombeo El Vidrio, estado Lara. 5 de mayo de 2006.', 'img/chavez/052.png');
INSERT INTO frases_chavez VALUES (54, 'Tengo fe en el buen juicio y la conciencia del pueblo. Al pueblo lo pueden engañar a veces a través de grandes manipulaciones, pero cuando despierta se convierte en el más grande sabio que puede haber entre cielo y tierra.', 'II Gabinete Móvil Comunal. Barquisimeto, estado Lara. 6 de mayo de 2006.', 'img/chavez/054.png');
INSERT INTO frases_chavez VALUES (55, 'La revolución verdadera no es la de los fusiles sino la de las ideas, la del estudio; ¡profundicemos la revolución moral!, ¡avancemos en la revolución social para que todos seamos iguales!, ¡potenciemos la revolución económica para que todos podamos vivir dignamente!', 'Inauguración del Liceo Bolivariano Jorge Rodríguez, Avenida Jacinto Lara, El Cercado, Barquisimeto, estado Lara. 6 de mayo de 2006.', 'img/chavez/055.png');
INSERT INTO frases_chavez VALUES (56, 'Hemos pedido que se estudien a fondo las razones del incremento de los precios del petróleo, y más allá de los precios, que veamos las causas de lo que puede configurar una crisis peligrosa para el mundo: la crisis energética.', 'Declaraciones del presidente Chávez a la salida de la reunión con el jefe de Gobierno de Austria, Heinz Fischer. Viena, Austria; 13 de mayo de 2006.', 'img/chavez/056.png');
INSERT INTO frases_chavez VALUES (58, '¡No podemos fallarle al mundo! De lo que pase en Venezuela, del éxito de nuestra Revolución puede depender, en el futuro, la salvación de este planeta.', 'Inauguración de la Unidad Materno Infantil “Dr. Oswaldo Ismael Brito. Tucupita, estado Delta Amacuro; 20 de mayo de 2006.', 'img/chavez/058.png');
INSERT INTO frases_chavez VALUES (59, 'La educación es sagrada, no se puede privatizar porque es un derecho humano fundamental.', 'Marcha y concentración “El rugido de los precursores. Plaza Bicentenaria del Palacio de Miraflores. 3 de junio de 2006.', 'img/chavez/059.png');
INSERT INTO frases_chavez VALUES (61, 'Los capitalistas ven a los indigentes como deshechos, incluso no quieren verlos; nosotros vamos por ellos donde estén, sea cual sea su condición, aunque estén a las puertas del infierno.', 'Aló Presidente N° 257. Parque Nacional El Ávila, 4 de junio de 2006.', 'img/chavez/061.png');
INSERT INTO frases_chavez VALUES (62, 'Continuaremos buscando todas las alternativas posibles para incrementar el nivel de vida de la familia venezolana.', 'Pago de prestaciones sociales 2002-2003 al personal docente, administrativo y obrero de las universidades nacionales. Salón Ayacucho, Palacio de Miraflores; 8 de junio de 2006.', 'img/chavez/062.png');
INSERT INTO frases_chavez VALUES (69, 'En Venezuela se acabó la falsa democracia de las élites, tenemos que encerrarla de finitivamente y terminar de construir la democracia socialista, participativa, protagónica.', 'II Gabinete Móvil Comunal. Barquisimeto, estado Lara; 06 de mayo de 2006.', 'img/chavez/069.png');
INSERT INTO frases_chavez VALUES (70, 'Lo de ‘Presidente’ a mí, en verdad, no me importa mucho, lo que sí me importa es nunca perder mis raíces, nunca perder el contacto directo con ustedes, sino navegar en el alma del pueblo al que pertenezco.', 'Inauguración del Liceo Bolivariano Jorge Rodríguez, Avenida Jacinto Lara, El Cercado, Barquisimeto, estado Lara. 6 de mayo de 2006.', 'img/chavez/070.png');
INSERT INTO frases_chavez VALUES (71, 'No defendemos intereses mezquinos, defendemos, con nuestra vida, el interés del pueblo y de la República, y de ahí no nos sacará nada, ni nadie.', 'Aló Presidente N° 254. Barquisimeto, estado Lara; 7 de mayo de 2006.', 'img/chavez/071.png');
INSERT INTO frases_chavez VALUES (72, 'La Revolución que el pueblo venezolano está impulsando busca, sobre todo, darle igualdad al país, igualdad con libertad.', 'Entrevista al Presidente Chávez por el periodista Enzo Micalizzi, del Canal RAI-2 de Italia. 10 de mayo de 2006', 'img/chavez/072.png');
INSERT INTO frases_chavez VALUES (74, 'Estamos empeñados en continuar por este rumbo en lo social, en lo político, una democracia plena, cada día más vigorosa, participativa y protagónica; en lo económico, un proyecto para dar un nuevo modelo que sea productivo, diversificado y moderno; para alcanzar una economía al servicio de la gente y no al servicio de minorías.', 'Reunión con empresarios del Reino Unido. Canning House, Londres; 15 de mayo de 2006.', 'img/chavez/074.png');
INSERT INTO frases_chavez VALUES (76, 'Pido, como pediría por mi vida, y creo que me importa más esto que mi propia vida, que la Revolución Bolivariana sea auténtica, que no sea una mentira como tantas ha habido, que no sea otro fracaso. ¡Eso me importa un millón de veces más que mi propia vida!', 'Inauguración de la Unidad Materno Infantil “Dr. Oswaldo Ismael Brito. Tucupita, estado Delta Amacuro; 20 de mayo de 2006.', 'img/chavez/076.png');
INSERT INTO frases_chavez VALUES (77, 'Estamos sembrando el petróleo, don Úslar, donde quiera que esté, ¡estamos sembrando el petróleo!', 'Aló Presidente Nº 255. Ciudad Guayana, Estado Bolívar. 21 de mayo de 2006.', 'img/chavez/077.png');
INSERT INTO frases_chavez VALUES (79, 'Los soldados somos pueblo en uniforme, no podemos ser mercenarios a la orden de imperios extranjeros.', 'Aló Presidente N° 256. Ciudad Sagrada de Tiwanaku, Bolivia; 28 de mayo de 2006.', 'img/chavez/079.png');
INSERT INTO frases_chavez VALUES (80, 'En Venezuela algunos medios de comunicación privados nos atacan por estar rescatando la dignidad del país, pero aplaudían cuando se estaba entregando la dignidad nacional.', 'Firma de acuerdos de cooperación energética entre la República Bolivariana de Venezuela y la República del Ecuador. Palacio Presidencial Carondelet, Quito, Ecuador. 30 de mayo de 2006', 'img/chavez/080.png');
INSERT INTO frases_chavez VALUES (83, 'Queremos trabajadores patriotas, un sector privado nacionalista, comprometido con el pueblo de Venezuela y con la Patria.', 'Colocación de la piedra fundacional del desarrollo habitacional “Terrazas del Alba. Municipio Libertador, Distrito Capital; 2 de junio de 2006.', 'img/chavez/083.png');
INSERT INTO frases_chavez VALUES (84, 'Nunca volveremos a ese pasado de exclusión, explotación, atropello y desconocimiento a los derechos de los trabajadores de Venezuela.', 'Entrega de titularidad a docentes del estado Zulia. Plaza de Toros Monumental de Maracaibo, 10 de junio de 2006.', 'img/chavez/084.png');
INSERT INTO frases_chavez VALUES (85, 'No podemos ser tan irresponsables y seguir dándole concesiones a un pequeño grupo de personas para que usen el espacio radioeléctrico, que es del Estado, es decir, del pueblo; contra nosotros mismos, en nuestras propias narices, como una quinta columna.', 'Entrega de fusiles de asalto Kalashnikov AK-103. Patio de Honor del Ministerio de la Defensa. 14 de junio de 2006', 'img/chavez/085.png');
INSERT INTO frases_chavez VALUES (86, 'Una revolución política y una revolución social, deben estar acompañadas de una revolución económica, si no estaría condenada a morir, más temprano o más tarde.', 'Entrega de Financiamientos a los primeros 200 Bancos Comunales. Teatro Teresa Carreño, 15 de junio de 2006', 'img/chavez/086.png');
INSERT INTO frases_chavez VALUES (87, 'Dificulto que haya otro país en el mundo, y no estoy exagerando, donde haya plena libertad de expresión, que raye incluso en el abuso, como la hay en Venezuela, donde se dice y escribe lo que se quiere.', 'Rueda de prensa del presidente Chávez. Hotel Cæsar Park, República de Panamá; 23 de junio de 2006.', 'img/chavez/087.png');
INSERT INTO frases_chavez VALUES (89, 'El proyecto nacional debe tener varios componentes. Recordemos que la estrategia es ¿cómo hacerlo?, la política ¿qué hacer? y el poder nacional ¿con qué hacerlo? Las tres forman un triángulo indisoluble.', 'Aló Presidente N° 251. Hato San Pablo Paeño, estado Apure; 2 de abril de 2006.', 'img/chavez/089.png');
INSERT INTO frases_chavez VALUES (91, 'La conciencia es el resultado del conocimiento, por eso hay que estudiar, leer y analizar mucho.', 'Declaraciones del presidente Chávez durante la inauguración de Aldeas Universitarias. 5 de abril de 2006', 'img/chavez/091.png');
INSERT INTO frases_chavez VALUES (101, 'Se acabaron aquellos carnavales electorales donde la gente iba a votar sin saber por qué votaba. ¡No!, cada venezolano que vote por Hugo Chávez el próximo diciembre, debe votar por la Revolución y la construcción del socialismo en Venezuela.', 'II Gabinete Móvil Comunal. Barquisimeto, estado Lara. 6 de mayo de 2006.', 'img/chavez/101.png');
INSERT INTO frases_chavez VALUES (102, 'Debemos avanzar en ríos de pueblo, siempre cargados de muchas ideas, con mucha organización, con capacidad de maniobra, con una estrategia común, hacia ese mundo azul del mar futuro donde reine la igualdad, la libertad, la fraternidad, la solidaridad y el amor.', 'Encuentro del presidente Chávez con el Movimiento “Manos Fuera de Venezuela. Viena, Austria; 12 mayo de 2006.', 'img/chavez/102.png');
INSERT INTO frases_chavez VALUES (268, 'El Movimiento Bolivariano Revolucionario 200 dio un paso al frente para conseguirse en un abrazo infinito con el pueblo al que pertenecemos como soldados.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (103, 'Pido a gobernadores, alcaldes y funcionarios que no limitemos al pueblo venezolano, sino que lo ayudemos, lo impulsemos y le abramos los canales y los caminos para que haga una verdadera revolución.', 'III Gabinete Móvil de Consejos Comunales. Tucupita, estado Delta Amacuro; 20 de mayo de 2006.', 'img/chavez/103.png');
INSERT INTO frases_chavez VALUES (104, 'Los revolucionarios, los socialistas, los que estén convencidos de que hay que hacer transformaciones profundas en Venezuela, deben votar por la Revolución Bolivariana.', 'Inauguración de la Unidad Materno Infantil “Dr. Oswaldo Ismael Brito. Tucupita, estado Delta Amacuro; 20 de mayo de 2006.', 'img/chavez/104.png');
INSERT INTO frases_chavez VALUES (105, 'Cada uno de nosotros debe ser como una antorcha que vaya por los caminos iluminando a los demás, prendiéndolos de conciencia y de amor patrio. ¡De la conciencia surge la voluntad nacional que hoy ha despertado!', 'Firma de acuerdos, convenios y memorandos de entendimiento en el marco del ALBA y el TCP. Patio Central del Palacio de Gobierno de La Paz, Bolivia.; 26 de mayo de 2006.', 'img/chavez/105.png');
INSERT INTO frases_chavez VALUES (106, 'La política, la estrategia y los recursos, son los tres elementos fundamentales para atender los problemas más urgentes y apremiantes de nuestros pueblos.', 'Conferencia de prensa del presidente Chávez. Residencia del Embajador de Venezuela, Quito, Ecuador. 30 de mayo de 2006.', 'img/chavez/106.png');
INSERT INTO frases_chavez VALUES (107, 'Se los pronostico: ¡nocaut! Nosotros, los revolucionarios, los nacionalistas, los patriotas, los socialistas, vamos a dar nocaut a los derechistas, a los capitalistas y a los pro imperialistas.', 'Aló Presidente N° 257. Parque Nacional El Ávila, 4 de junio de 2006.', 'img/chavez/107.png');
INSERT INTO frases_chavez VALUES (108, 'De los jóvenes es el futuro; nosotros tenemos que terminar de abrir el camino y despejar el panorama, porque ellos harán la Patria completa.', 'Pago de prestaciones sociales 2002-2003 al personal docente, administrativo y obrero de las universidades nacionales. Salón Ayacucho, Palacio de Miraflores; 8 de junio de 2006.', 'img/chavez/108.png');
INSERT INTO frases_chavez VALUES (111, 'Nadie mejor que los maestros para seguir encendiendo la llama, el fuego sagrado de la Patria nueva.', 'Entrega de titularidad a docentes del estado Zulia. Plaza de Toros Monumental de Maracaibo, 10 de junio de 2006.', 'img/chavez/111.png');
INSERT INTO frases_chavez VALUES (112, 'Debemos dedicarnos por entero en mente, cuerpo, alma y espíritu para que la historia que estamos escribiendo sea distinta.', 'Aló Presidente Nº 258. Villa Bruzual, estado Portuguesa; 11 de junio de 2006.', 'img/chavez/112.png');
INSERT INTO frases_chavez VALUES (113, 'Tenemos que actuar y hacer cumplir la Constitución y las leyes de la República, para proteger a nuestro pueblo y a la unidad nacional.', 'Entrega de fusiles de asalto Kalashnikov AK-103. Patio de Honor del Ministerio de la Defensa. 14 de junio de 2006.', 'img/chavez/113.png');
INSERT INTO frases_chavez VALUES (115, 'El socialismo bolivariano acepta la propiedad privada, siempre subordinada al interés colectivo y en el marco de las leyes nacionales.', 'Aló Presidente N° 251. Hato San Pablo Paeño, estado Apure; 2 de abril de 2006.', 'img/chavez/115.png');
INSERT INTO frases_chavez VALUES (119, 'Mientras no haya una sociedad de incluidos, de iguales y de justos no habrá paz verdadera.', 'Aló Presidente N° 252. Campo de Carabobo, 9 de abril de 2006.', 'img/chavez/119.png');
INSERT INTO frases_chavez VALUES (121, 'El capitalismo es el reino de Judas, el reino de la ambición; el socialismo es el reino del colectivo y de la hermandad.', 'Entrevista radial de ALER (Asociación Latinoamericana de Educación Radiofónica) al presidente de la República Bolivariana de Venezuela, Hugo Chávez. Asunción, Paraguay; 19 de abril de 2006.', 'img/chavez/121.png');
INSERT INTO frases_chavez VALUES (122, 'Hemos relanzado al mundo la necesidad de discutir el camino por el que vamos a seguir, y nosotros no tenemos dudas de que debe ser el socialismo.', 'Conferencia de prensa del presidente Chávez con medios nacionales y corresponsales, en el marco de los acuerdos del ALBA. Palacio de Miraflores, 24 de mayo de 2006.', 'img/chavez/122.png');
INSERT INTO frases_chavez VALUES (150, 'Hasta el más lejano rincón debe llegar la mano de la justicia para poner orden en la propiedad de la tierra; ¡tierra para los campesinos!, ¡tierra para el que la trabaje!, ¡tierra para los verdaderos productores!, ¡justicia para el campo!', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (151, 'Mientras no derrotemos al latifundio, no podremos echar adelante ningún proyecto de desarrollo integral para Venezuela.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (157, 'La conciencia del pueblo es el combustible fundamental para alcanzar una revolución victoriosa.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (163, 'Los Consejos Comunales son expresión del poder constituyente originario.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (164, 'Al constituirse los Consejos Comunales con una ley, un propósito, una definición clara, un concepto y una praxis en plena construcción, estamos siendo coherentes con la Revolución y con la esperanza de un pueblo.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (166, 'Tenemos que enterrar el capitalismo en cada esquina, en cada pueblo y en cada barrio; nunca me cansaré de decir esto: los Consejos Comunales son espacios fundamentales en esta batalla.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (109, '¡Cada maestro debe ser un líder!', 'Hugo Rafael Chávez Frías', 'img/chavez/109.png');
INSERT INTO frases_chavez VALUES (143, 'Es imposible que el capitalismo tenga rostro humano, porque es perverso.', 'Hugo Rafael Chávez Frías', 'img/chavez/143.png');
INSERT INTO frases_chavez VALUES (160, 'Un superior máximo, después de Dios, lo conforman ustedes mismos como pueblo, y yo siempre estaré obedeciéndoles.', 'Hugo Rafael Chávez Frías', 'img/chavez/092.png');
INSERT INTO frases_chavez VALUES (152, 'La aldea universitaria no debe tener muros que la separen del pueblo, la aldea universitaria es del pueblo y para el pueblo.', 'Hugo Rafael Chávez Frías', 'img/chavez/004.png');
INSERT INTO frases_chavez VALUES (246, 'En América Latina van a seguir llegando nuevos liderazgos, porque están sustentados en el clamor de las mayorías; es la voz de la nación la que se está expresando y buscando nuevos caminos.', 'Hugo Rafael Chávez Frías', 'img/chavez/058.png');
INSERT INTO frases_chavez VALUES (168, 'Los Consejos Comunales no pueden quedarse en la superficie ni en el simple hecho de hacer un proyecto, presentarlo y que nos den un recurso: ese no es el objetivo fundamental, necesitamos que se vayan estructurando en una verdadera célula-motor en cada comunidad.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (169, 'Los Consejos Comunales constituyen el proyecto que dará el paso histórico para convertir la vieja democracia representativa, sin pueblo, en una democracia verdadera, a través de la cual marchemos hacia el socialismo.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (171, 'Cada día deben ser gobiernos populares los que deben consolidarse en Venezuela.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (173, 'Los Consejos Comunales son las células de la democracia bolivariana y revolucionaria.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (177, 'Nadie debe adueñarse de los Consejos Comunales. ¡Los Consejos Comunales son el poder popular!', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (179, 'A cada agresión del imperialismo, ¡profundización de la Revolución!', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (181, '¡Ningún plan perverso del imperialismo podrá detener el nuevo camino que señalan los pueblos de América Latina!', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (401, 'América Latina se levanta y sus pueblos escribirán en este siglo la página más grande de toda su historia.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (187, 'La amenaza más grande que enfrenta la especie humana es el imperio norteamericano.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (189, 'Hay que retomar el principio de la soberanía y transformarlo en voluntad nacional.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (195, 'En Washington no nos perdonan que nos hayamos liberado del yugo imperialista. ¡Somos libres para tomar nuestras propias decisiones!', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (196, '¡Seremos libres para siempre! Con el favor de Dios, el trabajo de todos y la conciencia del pueblo venezolano.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (201, 'Por la dignidad, por la soberanía de nuestros pueblos, no nos queda más que unirnos contra esa amenaza común que es el imperio de Estados Unidos, el imperialismo mundial, el capitalismo mundial.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (203, 'Algunas televisoras emiten mensajes dirigidos al odio, al irrespeto a las instituciones, a la duda de unos a otros, a los rumores. Guerra sicológica para dividir a la Nación, para debilitarla y para destruirla. ¡Ese es un plan imperialista! ¡Son caballos de Troya en nuestras propias narices!', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (204, '¡El arma más poderosa que pueda tener un soldado es la conciencia patria!', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (205, 'La moral, el espíritu combativo y la conciencia patria deben ser las armas más poderosas', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (208, 'No hay otra fórmula sino avanzar, avanzar y avanzar en la integración.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (209, 'Recordemos, bolivarianas, bolivarianos, que la Patria para nosotros no es sólo Venezuela, para nosotros Venezuela es como el corazón de la Patria. ¡La patria es esta América, este Caribe, esta Suramérica, esta América Latinocaribeña! ¡Esa es nuestra Patria!', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (210, 'Somos patriotas de la gran Patria Latinocaribeña, esa es nuestra Patria verdadera.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (214, 'La integración en la que yo creo, en la que nosotros creemos, es la que se basa en la cooperación, en la solidaridad, en la complementariedad y en el reconocimiento de las asimetrías.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (216, 'Tenemos varios años proponiendo líneas estratégicas de cooperación, solidaridad y complementariedad en Suramérica, porque tenemos una conciencia histórica acerca de la importancia de la unidad.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (217, 'Comenzamos a proponer la conciencia unitaria, bolivariana, mirandina; la necesidad de apuntalar la unión como único camino a nuestra independencia.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (222, 'Nuestro rumbo no está en el Norte, insistimos, nuestro rumbo está en el Sur; tenemos que terminar de liberarnos de esos viejos mecanismos para apuntalar la integración del Sur.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (226, 'Ningún país mejor ubicado que Venezuela, desde el punto de vista geográfico, geopolítico y económico, para cumplir un papel como de engranaje y ayudar a acelerar la integración de toda Suramérica.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (227, 'Suramérica siempre se me ha parecido a una bella mujer bailando en un pie.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (228, 'Cuando Venezuela decide salirse del llamado G-3, lo hace para salvaguardar los intereses nacionales y apuntalar el ingreso al Mercosur.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (230, 'Los pueblos de nuestra América se levantan, y se levantan sobre su conciencia.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (231, 'No tenemos otra alternativa que reunirnos, volver a unirnos ahora, comenzando el siglo,para hacer realidad el proyecto de liberación y de desarrollo integral de nuestros pueblos.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (233, 'Respetamos la soberanía y el carácter político e ideológico de cada país, respetamos a cada país; sólo queremos integrarnos, acercarnos, porque es imprescindible para el futuro de nuestros pueblos, y esa realidad trasciende las situaciones políticas internas.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (236, 'La integración debe estar fundamentada en tres principios: cooperación, solidaridad y complementariedad, para darle forma a la Alternativa Bolivariana para los Pueblos de Nuestra América.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (238, 'Tenemos siete años proponiendo un cambio de enfoque. Llegó el momento de comenzar a liberarnos de las cadenas del pasado, de reconocer que hemos heredado mecanismos injustos de comercio, acuerdos y tratados.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (243, 'En la Patria grande hay una emergencia de corrientes populares progresistas, corrientes revolucionarias, corrientes de izquierda que claman por un cambio.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (252, 'Estados Unidos pretende dividirnos a través de los TLC. ¡No lo van a lograr! Nos sobrepondremos a ello, contraatacaremos con amor y con ganas de seguir integrándonos y buscando alternativas.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (256, 'Mientras no haya una sociedad de incluidos, de iguales y de justos, no habrá paz verdadera.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (257, 'Tenemos que terminar de borrar las fórmulas extrañas a nosotros mismos y buscar los códigos de nuestro pensamiento más antiguo.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (263, 'Nuestros pueblos originarios han conservado sus raíces socialistas.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (267, 'El 4 de febrero partió en dos la historia venezolana: es fecha de fin e inicio, muerte y parto. Es hijo directo y legítimo del 27 de febrero de 1989.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (38, 'Seamos justos y habrá paz.', 'Hugo Rafael Chávez Frías', 'img/chavez/038.png');
INSERT INTO frases_chavez VALUES (270, 'La victoria popular de este año 2006, se la dedicamos al generalísimo Francisco de Miranda en el Bicentenario de su llegada a las costas venezolanas, portando nuestra bandera, con ese grito: Libertad o muerte.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (271, 'La batalla contra el imperialismo de Estados Unidos comenzó con Bolívar. Ahora, nosotros hemos tomado su bandera, y le pido a todos que hagamos todo cuanto haya que hacer para que, 200 años después, derrotemos al imperialismo norteamericano y contribuyamos a salvar la vida en este planeta.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (274, 'Vencer significa lograr la concreción firme, la concreción profunda, la concreción plena e integral del proyecto nacional de Simón Bolívar.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (429, '¡Dios mío, líbranos de una guerra! Pero tenemos que prepararnos para defender la patria.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (279, 'No es lo mismo hablar de revolución democrática que de democracia revolucionaria. El primer concepto tiene un freno conservador; el segundo es liberador.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (280, 'Tenemos que ser creativos continuamente. Hay que buscar la teoría; no hay revolución sin teoría revolucionaria.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (281, 'Invito a todos a que pensemos, diseñemos y pongamos en práctica acciones en todos los ámbitos para fortalecer y llenar de fuerza transformadora a la Democracia Revolucionaria.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (282, 'Hemos enterrado sí, el Pacto de Punto Fijo, lo cual no significa que hemos enterrado definitivamente los vicios de la IV República y las amenazas que se siguen cerniendo sobre nosotros. Obligados estamos a romper con ellos y darle cada día más vida a una democracia vigorosa, participativa, protagónica.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (284, 'Me gustan mucho los números, ¡sí!; trato de entender e interpretar la vida a través de los números.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (285, '¿Cuál es la diferencia política entre la Venezuela de hoy y la Venezuela de hace siete años?: Hemos enterrado el Pacto de Punto Fijo, que tanto daño le hizo a la República; nos hemos liberado de la tiranía interna que sufría nuestra patria, aprisionada por una elite contraria a nuestros intereses; hemos cortado las cadenas que nos oprimían desde el exterior.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (287, 'La Revolución Bolivariana acabó, en sus primeros siete años, con quinientos años de analfabetismo.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (290, 'Dios quiso que se abriera el camino y que un pueblo consciente, noble y valiente nos trajera aquí.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (293, 'Somos miembros de lo que se llama poder constituido, democracia representativa, pero estamos obligados a impulsar la construcción de la democracia participativa.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (298, 'La democracia de élites, representativa, es contrarrevolucionaria. Un Gobierno tomando decisiones encerrado en cuatro paredes, expropiándole al pueblo su soberanía, es contrarrevolucionario.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (309, 'Llamo a todos a luchar a muerte contra el latifundio: en pocos años, no debe quedar ni vestigio del latifundio en estas tierras, ¡es un reto para todos nosotros!', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (312, 'Nuestras empresas de Estado deben estar cada día más compenetradas, desde sus presidentes y gerentes, hasta sus trabajadores y obreros, en el proyecto revolucionario de transformación integral del país.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (315, 'Nosotros somos representantes, pero hemos jurado darle vida a una democracia no representativa, sino participativa, y más allá: protagónica.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (318, 'Este es el año del poderoso impulso a la participación popular; no hay democracia sin la participación real del pueblo.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (321, 'Así como un arco que cae, la tendencia inevitable de toda democracia representativa es derivar en un sistema de gobierno burocrático y elitesco.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (322, 'Es necesario visualizar la necesidad de legislar para darle mayor fortaleza a la participación del pueblo, al poder popular que está en marcha.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (325, 'Si queremos cambiar el mundo, el pueblo debe ir tomando el poder.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (327, 'Debemos concentrar la sabiduría del pueblo en la enseñanza del autogobierno.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (330, 'Estamos creando una escuela democrática nueva, en la que buscamos distintos mecanismos para que la transferencia del poder al pueblo sea mayor y más precisa.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (332, 'El poder popular es la clave fundamental para reconstruir la República.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (336, '¡Con el pueblo todo!, ¡sin el pueblo nada!', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (341, 'Frente a cada agresión debe surgir una ley que vaya conformando un escudo para neutralizarla.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (342, 'La historia se puede y se debe planificar.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (343, 'De cada barrera reconocida debe surgir una ley para demolerla.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (344, 'Hay que empezar a trabajar para lograr los diez millones de votos y la ratificación de un Gobierno que cada día estará más comprometido con un proyecto, con un sueño y con un pueblo.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (345, 'Intervención en el acto de presentación de la nueva Junta Directiva de la Asamblea Nacional al Poder Ejecutivo Palacio Blanco, 6 de enero de 2006', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (352, 'Necesitaremos mucha astucia, inteligencia, talento estratégico, unidad, conciencia, trabajo, para derrotar una vez más al imperio norteamericano y su pretensión de sabotear el proceso electoral del tres de diciembre de este año.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (353, '¡Unidad! ¡Unidad! ¡Unidad!, es imprescindible para ganar esta batalla y todas las que vienen.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (356, 'Hay que olvidar las peleas tontas y las diferencias entre nosotros mismos. Tenemos que unirnos para defender la Revolución y la Patria.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (358, 'No podemos dejarnos penetrar por el discurso del adversario; muy críticos tenemos que ser con nosotros mismos, pero siempre objetivos.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (361, 'Pongamos por delante la gran pasión: la Patria, el interés de la Nación.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (364, 'Cada embajada de Venezuela hoy, en cualquier parte de este inmenso mundo, debe ser una trinchera de batalla.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (351, 'La batalla de Santa Inés es para darle a nuestra patria otra resonante victoria popular, política y revolucionaria.', 'Hugo Rafael Chávez Frías', 'img/chavez/065.png');
INSERT INTO frases_chavez VALUES (366, 'El socialismo es el camino para construir un mundo de justicia social, igualdad y hermandad.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (369, 'Este debe ser nuestro siglo, el siglo bueno de la vida, el siglo de nuestros pueblos, el siglo de la libertad, la justicia y la igualdad.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (430, 'Si aquí tenemos que morir defendiendo a Venezuela, aquí moriremos defendiendo nuestra soberanía.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (372, 'Estamos construyendo el camino hacia el socialismo, colocando al ser humano en primer lugar.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (376, 'Un nuevo modelo de integración no se puede basar en la competencia comercial, tiene que hacerse desde el alma de los pueblos, desde la complementación y el apoyo solidario.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (378, 'El socialismo que estamos construyendo debe fundamentarse en la cultura, en los valores, en lo social y por lo social. Debemos colocar en primer lugar a los seres humanos.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (381, 'Hay que insistir en la creación de un nuevo modelo socialista, indoamericano, martiano, bolivariano, criollo, nuestro; un camino distinto a la destrucción del planeta.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (385, 'Vamos caminando hacia el socialismo, para dejar atrás vel modelo perverso del capitalismo, que todo lo privatiza y a todo le quita el alma.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (391, 'El Gobierno venezolano no regala, el Gobierno venezolano es integracionista; lo que aquí antes se llevaban y se robaban las élites y el imperio norteamericano, ahora lo hemos recuperado, y parte de ello lo compartimos con pueblos hermanos.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (371, 'Cada Liceo Bolivariano debe constituirse en un polo, en un núcleo de desarrollo endógeno que impacte el desarrollo social de las comunidades; debe ser un motor para el desarrollo social, la organización comunitaria y algo muy importante: la educación para el trabajo.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (405, 'Vean lo que tiene Suramérica: el primer reservorio de petróleo del mundo, uno de los más grandes de gas y el primer reservorio de agua del planeta. No es utopía lo que decimos: ésta es la cuna de un proyecto que bien puede alterar el curso de la historia.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (408, 'Los verdaderos patriotas debemos entender que para que haya un continente verdaderamente libre, requerimos del desarrollo y de la unidad con todos nuestros pueblos.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (419, 'Podemos salvar a los pueblos de este mundo, y para ello es imprescindible contar con el pueblo de Estados Unidos, con la conciencia del pueblo de Estados Unidos, con la resurrección del pueblo de Estados Unidos.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (423, 'Creo que este siglo XXI que comienza, es el siglo que marcará el fin del imperio norteamericano.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (425, 'Estamos enfrentando, compatriotas, al imperio más poderoso, al imperio más inmoral, al imperio más cínico, al imperio más asesino que haya existido en toda la historia de este planeta.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (426, '¡Este debe ser el siglo del fin del imperio genocida de Estados Unidos!', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (428, 'El enemigo de los pueblos de América Latina, enemigo de todos los proyectos libertarios de América Latina, enemigo de las esperanzas de los pueblos de América Latina y del Caribe; es la elite imperialista de los Estados Unidos.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (433, 'Al imperio no hay que subestimarlo, pero tampoco hay que temerle.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (435, 'El imperialismo norteamericano lleva varios años tratando de aislarnos, pero han fracasado y fracasarán porque no tienen razón ni moral alguna, y porque cada día los pueblos conocen mejor la verdad sobre Venezuela.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (436, 'Seguiremos nuestro rumbo: construyendo nuestro país e impulsando nuestro proyecto internacional de un mundo multipolar donde se respete la igualdad entre los estados.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (438, 'Los gobiernos de la IV República estaban subordinados al imperio norteamericano, eran sus peones. Hoy nosotros no somos peones, somos dueños de nuestro propio destino, ¡somos libres!', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (440, 'Nunca habrá un ‘frente contra Chávez’, porque los pueblos saben que la amenaza a este pequeño mundo nuestro no se llama Hugo Chávez, sino que precisamente la representa el gobierno de Estados Unidos.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (442, '¡Vaya qué democracia tienen en Estados Unidos! Pretenden presentarse ante el mundo como los campeones de la democracia, cuando lo que realmente existe es una dictadura de poderosísimos grupos económicos que tienen una marioneta llamada George W. Bush.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (462, 'Un gobernante, un representante de cualquier nivel, no puede andar sin un libro bajo el brazo.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (465, 'Una cosa es el error y otra cosa es el engaño: nosotros bien podemos equivocarnos, pero mal podemos engañarnos.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (450, 'Luchamos con fervor por una sociedad socialista que signifique la liberación plena de la mujer como género, como actor social transformador del mundo.', 'Hugo Rafael Chávez Frías', 'img/chavez/126.png');
INSERT INTO frases_chavez VALUES (446, 'Siempre he creído que uno de los grandes males del capitalismo es la exclusión a la mujer, la minimización del gran potencial que tiene la mujer para desempeñarse en cualquier tarea, por más dura y por más exigente que sea.', 'Hugo Rafael Chávez Frías', 'img/chavez/124.png');
INSERT INTO frases_chavez VALUES (449, 'Un equipo de Gobierno debe estar cada día más acompañado de mujeres; ellas siempre ponen un extra, una dosis de amor, fuerza, pasión, coraje, entrega; elementos intrínsecos de la mujer.', 'Hugo Rafael Chávez Frías', 'img/chavez/032.png');
INSERT INTO frases_chavez VALUES (451, 'No se podrá salvar el mundo si no logramos la plena igualdad del género y la participación de la mujer como actor fundamental de las distintas luchas que libramos.', 'Hugo Rafael Chávez Frías', 'img/chavez/010.png');
INSERT INTO frases_chavez VALUES (453, 'Invito a las mujeres venezolanas a incorporarse en masa a la reserva militar, para defender la soberanía de la Patria ante cualquier amenaza imperialista.', 'Hugo Rafael Chávez Frías', 'img/chavez/004.png');
INSERT INTO frases_chavez VALUES (454, 'Las mujeres venezolanas son las protagonistas, líderes de las misiones bolivarianas.', 'Hugo Rafael Chávez Frías', 'img/chavez/111.png');
INSERT INTO frases_chavez VALUES (456, 'Al mundo debemos salvarlo, pero al mundo no podemos salvarlo sólo los hombres. ¡Sin participación de las mujeres no hay mundo posible!; ¡sin ellas no habrá paz, libertad ni futuro posible!', 'Hugo Rafael Chávez Frías', 'img/chavez/038.png');
INSERT INTO frases_chavez VALUES (476, 'La Patria necesita patriotas; ya hemos tenido suficientes traidores.', 'Hugo Rafael Chávez Frías', 'img/chavez/125.png');
INSERT INTO frases_chavez VALUES (477, 'El venezolano, el revolucionario, es del tamaño del compromiso de la historia.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (409, 'América Latina es impulsada por la conciencia de sus pueblos hacia una dirección alternativa con las variantes correspondientes, naturales, lógicas y absolutamente necesarias, en base a nuestras particularidades, nuestras fortalezas y nuestras posibilidades.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (481, 'No habrá verdadera Revolución si no tocamos la fibra moral de la nación, para elevarla hasta lo más sublime del ser humano.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (482, 'Al pueblo organizado, capacitado: hagan el trabajo de todos los días y contarán con todo el apoyo político, moral, jurídico, económico y técnico del Gobierno Revolucionario.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (486, 'No podemos olvidar el significado del compromiso cristiano en la historia: la construcción de un mundo de vida, con justicia y en paz; afirmación en el pensar y en el hacer de la opción preferencial por los pobres que nos enseñó Jesús.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (489, 'Hay un despertar de nuestros pueblos; no nos toca a nosotros sino colocarnos a la altura de ese despertar.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (504, 'En Venezuela estamos construyendo la fórmula del hombre en sociedad, la fórmula de la paz, la fórmula de la hermandad, la fórmula del verdadero cristianismo: el hombre en libertad e igualdad.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (507, 'La economía debe estar al servicio de la política: hay que politizar la economía y también hay que socializar la política, ya que ésta debe colocar por delante los grandes intereses de la sociedad.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (509, 'En Venezuela enmascararon la privatización con una llamada ‘apertura petrolera’ nefasta para el interés nacional, que hoy en día está muerta y la estamos enterrando.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (513, 'Tiene que ejercerse el poder para beneficio de todos, no para salvaguardar intereses particulares.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (514, 'El gobierno administra el Tesoro de la Nación; así como durante muchos años los gobiernos lo administraron para favorecer a un sector determinado, ahora nosotros lo administramos con sentido de justicia.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (515, '¡Estamos arando tierra fértil y la siembra revienta por la sementera!, ¡es la Patria nueva que se levanta!', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (498, 'Tenemos la necesidad del diálogo permanente entre la Iglesia Católica y el Gobierno de la República Bolivariana; el diálogo debe ser nuestra opción irrenunciable, en la que cada quien mantenga su visión y su forma de entender y de actuar en la realidad nacional, pero sosteniendo siempre el diálogo abierto.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (519, 'Cada día la Patria venezolana debe ser más grande, más independiente, más autónoma, más soberana; en la medida que seamos más independientes, tendremos más capacidad para solucionar los gravísimos problemas heredados de la miseria, la pobreza y la exclusión.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (349, 'Hemos echado las bases políticas de lo nuevo que estamos comenzando a construir en estos siete años; bases ideológicas, sociales, económicas, militares, morales. Tengamos presente siempre, en todos ámbitos del pensamiento y acción del Gobierno Revolucionario, que sólo hemos echado las bases de lo que estamos comenzando a construir; eso es fundamental para entender lo que ahora está ocurriendo.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (389, 'No debe haber espacio para bajas pasiones en el corazón de los revolucionarios.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (411, 'En Venezuela está en marcha un proyecto nacional que tomó forma constitucional; nuestra Constitución es mucho más que una ley magna, es el proyecto nacional de país hecho Constitución.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (502, '¡Cristo es, sin duda, el paradigma del verdadero y auténtico revolucionario!: El que es capaz de dar su vida por los demás, y sobre todo por los más débiles, los pobres, los que estuvieron excluidos, los que han sufrido la opresión y la explotación de una sociedad injusta.', 'Hugo Rafael Chávez Frías', NULL);
INSERT INTO frases_chavez VALUES (15, 'El nuestro es un proyecto que se inscribe en la bandera de Simón Rodríguez, donde la educación es un derecho humano fundamental; el nuestro es un proyecto socialista que garantiza educación gratuita y de calidad para todos.', 'Hugo Rafael Chávez Frías', 'img/chavez/015.png');
INSERT INTO frases_chavez VALUES (20, 'Estoy comprometido con mi vida, con mi muerte incluso, por el destino de Venezuela. ¡Llamo a todos a que arreciemos la marcha en esta gran batalla!', 'Hugo Rafael Chávez Frías', 'img/chavez/020.png');
INSERT INTO frases_chavez VALUES (21, '¡Liberamos de verdad a Venezuela o morimos en el intento!', 'Hugo Rafael Chávez Frías', 'img/chavez/021.png');
INSERT INTO frases_chavez VALUES (23, '¡Somos todos o no hay Patria, sociedad ni futuro!', 'Hugo Rafael Chávez Frías', 'img/chavez/023.png');
INSERT INTO frases_chavez VALUES (27, 'La Revolución es una pasión, y la juventud es el elemento maravilloso que le inyecta fuerza a la Revolución Bolivariana.', 'Hugo Rafael Chávez Frías', 'img/chavez/027.png');
INSERT INTO frases_chavez VALUES (29, 'Cada ataque contrarrevolucionario debe ser respondido con el impulso y la profundización de la Revolución, las misiones surgieron como parte del ataque revolucionario.', 'Hugo Rafael Chávez Frías', 'img/chavez/029.png');
INSERT INTO frases_chavez VALUES (31, 'Las revoluciones no se planifican ni se decretan: ¡se desatan como los volcanes!', 'Hugo Rafael Chávez Frías', 'img/chavez/031.png');
INSERT INTO frases_chavez VALUES (500, 'La doctrina auténtica de Cristo, que es una doctrina liberadora, es una doctrina revolucionaria, por eso cada día somos más cristianos y estamos más con Cristo el Redentor de los pueblos.', 'Hugo Rafael Chávez Frías', 'img/chavez/079.png');
INSERT INTO frases_chavez VALUES (448, 'Invito, desde mi modesto puesto de batalla, a las mujeres venezolanas para que cada día asuman con mayor fuerza, pasión y amor, la lucha por la revolución socialista, por la Venezuela de nuestros hijos, de nuestros nietos; por la Venezuela futura, la Venezuela bonita.', 'Hugo Rafael Chávez Frías', 'img/chavez/036.png');
INSERT INTO frases_chavez VALUES (452, 'Quiero rendir tributo a las mujeres africanas que fueron traídas como esclavas, que aquí parieron a sus hijos y nos regalaron ese bello color, que ligado con el indio americano y el blanco europeo, ha generado la mezcla perfecta: esta civilización mágica que somos los latinoamericanos.', 'Hugo Rafael Chávez Frías', 'img/chavez/060.png');
INSERT INTO frases_chavez VALUES (508, 'Los líderes deben escuchar el clamor de los pueblos.', 'Hugo Rafael Chávez Frías', 'img/chavez/059.png');
INSERT INTO frases_chavez VALUES (488, 'Me atrevo a decirlo mirando el horizonte de este siglo: ¡ahora o nunca!, ¡ha resucitado este pueblo! Así lo sentimos, hay una resurrección en Latinoamérica, y nosotros no somos sino producto de ese renacimiento.', 'Hugo Rafael Chávez Frías', 'img/chavez/129.png');
INSERT INTO frases_chavez VALUES (40, 'Estamos dando pasos firmes en la construcción de un nuevo modelo educativo universitario: una universidad nueva, un nuevo proyecto de educación superior.', 'Hugo Rafael Chávez Frías', 'img/chavez/040.png');
INSERT INTO frases_chavez VALUES (44, 'El primero de todos los poderes, después del poder de Dios, es el conocimiento.', 'Hugo Rafael Chávez Frías', 'img/chavez/044.png');
INSERT INTO frases_chavez VALUES (45, 'Los seres humanos somos culpables de muchos desastres en este mundo, pero los seres humanos seguimos siendo la esperanza, ¡y salvaremos a este mundo con Dios por delante!', 'Hugo Rafael Chávez Frías', 'img/chavez/045.png');
INSERT INTO frases_chavez VALUES (48, 'Necesitamos una educación alejada del individualismo y del egoísmo, que siembre nuevos valores humanos y sociales.', 'Hugo Rafael Chávez Frías', 'img/chavez/048.png');
INSERT INTO frases_chavez VALUES (50, 'La Revolución permite construir una Patria verdadera, una Patria plena, donde lo más importante es el hombre.', 'Hugo Rafael Chávez Frías', 'img/chavez/050.png');
INSERT INTO frases_chavez VALUES (53, 'Cuenten conmigo para siempre, todos los días y todas las noches, en esta batalla grande y bonita contra la pobreza.', 'Hugo Rafael Chávez Frías', 'img/chavez/053.png');
INSERT INTO frases_chavez VALUES (57, 'Cada día el mundo está más esperanzado con la Revolución Bolivariana.', 'Hugo Rafael Chávez Frías', 'img/chavez/057.png');
INSERT INTO frases_chavez VALUES (60, 'Si estamos empeñados en salvar al planeta, debemos comenzar salvando los bosques, salvando las aguas, salvando a nuestra madre naturaleza.', 'Hugo Rafael Chávez Frías', 'img/chavez/060.png');
INSERT INTO frases_chavez VALUES (63, 'La democracia revolucionaria tiene que fundamentarse en la organización y la movilización popular.', 'Hugo Rafael Chávez Frías', 'img/chavez/063.png');
INSERT INTO frases_chavez VALUES (73, 'Capacidad, eficiencia y eficacia, orientadas a la satisfacción de las necesidades de nuestro pueblo, son los objetivos supremos de nuestra Revolución.', 'Hugo Rafael Chávez Frías', 'img/chavez/073.png');
INSERT INTO frases_chavez VALUES (75, 'Nunca me cansaré de pedirle a todos que nos quitemos, como quien se quita una telaraña pegajosa, los viejos vicios de la corrupción, la burocratización, la ineficiencia, la incapacidad, la falta de planificación, la falta de trabajo en equipo. ¡Todo eso hay que dejarlo atrás!', 'Hugo Rafael Chávez Frías', 'img/chavez/075.png');
INSERT INTO frases_chavez VALUES (78, 'Un presidente revolucionario tiene que andar en las calles junto al pueblo, en los campos con los campesinos. ¡Un presidente revolucionario no puede encerrarse en un palacio!', 'Hugo Rafael Chávez Frías', 'img/chavez/078.png');
INSERT INTO frases_chavez VALUES (81, 'Hemos recuperado el manejo del petróleo y de la riqueza petrolera. ¿Para qué? Para distribuirla, para sembrarla, para transformarla.', 'Hugo Rafael Chávez Frías', 'img/chavez/081.png');
INSERT INTO frases_chavez VALUES (82, 'Respetamos al sector privado, pero el sector privado tiene que subordinarse a los planes estratégicos de la Nación y de la Revolución.', 'Hugo Rafael Chávez Frías', 'img/chavez/082.png');
INSERT INTO frases_chavez VALUES (88, 'Formemos en nuestros niños un corazón para lo hermoso, para lo grande, para el sendero de la Patria buena.', 'Hugo Rafael Chávez Frías', 'img/chavez/088.png');
INSERT INTO frases_chavez VALUES (90, 'Debemos ser capaces de buscar el conocimiento verdadero y apartar los ruidos que tratan de inducirnos a la confusión. Debemos tener la vista y la mente clara.', 'Hugo Rafael Chávez Frías', 'img/chavez/090.png');
INSERT INTO frases_chavez VALUES (92, 'Para que nuestra Revolución nunca muera, siga avanzando y cada día esté más viva en el corazón y en el alma del pueblo, hacen falta muchas cosas, entre ellas es fundamental: la conciencia, coherencia, y organización del pueblo.', 'Hugo Rafael Chávez Frías', 'img/chavez/092.png');
INSERT INTO frases_chavez VALUES (94, 'Para que el pueblo se concrete en fuerza real debe tener, primero que nada, conciencia; y para que el pueblo tenga conciencia debe tener conocimiento y cultura.', 'Hugo Rafael Chávez Frías', 'img/chavez/094.png');
INSERT INTO frases_chavez VALUES (99, 'Tenemos que ayudar todos los días al nacimiento de la conciencia cuando no la haya, y al fortalecimiento de la conciencia cuando ya exista.', 'Hugo Rafael Chávez Frías', 'img/chavez/099.png');
INSERT INTO frases_chavez VALUES (110, 'Sembremos con muchas ideas, con mucho pensamiento, sabiduría y ejemplo las semillas, los arbolitos de la Patria futura, de la Patria grande, libre y próspera.', 'Hugo Rafael Chávez Frías', 'img/chavez/110.png');
INSERT INTO frases_chavez VALUES (114, '¡Que salgan los capitalistas a proponer el capitalismo a ver qué dicen los pueblos!', 'Hugo Rafael Chávez Frías', 'img/chavez/114.png');
INSERT INTO frases_chavez VALUES (116, 'La sociedad capitalista se encuentra profundamente enferma de egoísmo, ambiciones, individualismo e injusticia generadora de violencia.', 'Hugo Rafael Chávez Frías', 'img/chavez/116.png');
INSERT INTO frases_chavez VALUES (117, 'El capitalismo es el reino de lo privado, de lo individual. El socialismo es el reino de lo público, de lo colectivo.', 'Hugo Rafael Chávez Frías', 'img/chavez/117.png');
INSERT INTO frases_chavez VALUES (118, 'El socialismo no es el fin, el socialismo es el camino.', 'Hugo Rafael Chávez Frías', 'img/chavez/118.png');
INSERT INTO frases_chavez VALUES (120, 'El capitalismo es voraz, salvaje y anticristiano; nosotros defendemos el socialismo, que es humanista y cristiano.', 'Hugo Rafael Chávez Frías', 'img/chavez/120.png');
INSERT INTO frases_chavez VALUES (124, 'Tenemos que dar una lucha, pero en una batalla diaria, contra los antivalores del capitalismo.', 'Hugo Rafael Chávez Frías', 'img/chavez/124.png');
INSERT INTO frases_chavez VALUES (125, 'El capitalista crece y se forma en un caldo cuyos componentes son la mezquindad y el individualismo, conformándose así un modelo que destruye la esencia del ser humano.', 'Hugo Rafael Chávez Frías', 'img/chavez/125.png');
INSERT INTO frases_chavez VALUES (534, 'La independencia es la vía para convertir a Venezuela en un país potencia.', 'Recorrido por la Faja Petrolífera del Orinoco. 22 de agosto 2012', NULL);
INSERT INTO frases_chavez VALUES (537, 'Es un proyecto maravilloso... A través de la educación y la cultura surge la liberación de la mente y de los pueblos.', 'Instalación de la Fábrica de Computadoras Portátiles Canaima.
INSERT INTO frases_chavez VALUES (536, 'Impulsar la ciencia… Quiero motivar a todo el país a prepararse en profesiones científicas, es buscar la armonía entre todas las Ciencias.', 'Entrega de Computadoras Portátiles Canaimitas en las Escuelas Bolivarianas, de la Laguna de Sinamaica en el Estado Zulia.  17 de agosto 2012.', NULL);
INSERT INTO frases_chavez VALUES (538, 'Ustedes se lo merecen, son nuestras niñas, nuestros niños y jóvenes que merecen lo mejor, para que se capaciten al más alto nivel, para hacer de esta Venezuela cada día más grande y más hermosa.', 'Entrega de Computadoras Portátiles Canaimitas en Escuela Nacional Bolivariana Claudio Feliciano II. Parroquia Macarao. Mcpo. Libertador. Dto. Capital. 17 de septiembre de 2012.', NULL);
INSERT INTO frases_chavez VALUES (535, 'Sólo un país independiente puede ser grande, libre. Ahora hay que apurar el paso para el desarrolloINSERT INTO frases_chavez VALUES (547, 'Se ha ampliado la red de fibra óptica para democratizar el acceso a las telecomunicaciones de la población venezolana. En el 2007, después de la nacionalización de la CANTV, había 7.737 kilómetros de fibra óptica, limitada casi toda a la franja norte costera, ahora hemos avanzado hacia el sur y hacia el centro y el año pasado terminamos en 11.481 kilómetros, incluyendo conexión con Brasil y las zonas del sur. Este año debemos cerrar con cerca de 16.000 kilómetros, es decir, en apenas 5 años hemos más que duplicado la conectividad en Venezuela y además ahora disponible hasta para los pueblos indígenas.', 'Consejo de Ministros Palacio de Miraflores, Dtto. Capital. 22 de marzo de 2012.', NULL);
INSERT INTO frases_chavez VALUES (548, 'Un proyecto de conexión de televisión digital en el eje Buenos Aires-Caracas, con una especie de anillo óptico, para impulsar la soberanía entre ambos pueblos, impulsando nuestros propios contenidos. Esto forma parte de la integración suramericana.', 'Encuentro Latinoamericano de Telecomunicaciones. Buenos Aires, Argentina. Video Conferencia Caracas-Buenos Aires. 21 de marzo de 2012.', NULL);
INSERT INTO frases_chavez VALUES (542, 'La soberanía tecnológica se acopla a una política de Estado, todos los esfuerzos deben estar orientados a las necesidades del pueblo... No deben delegarse los proyectos, hay que hacerle el seguimiento y análisis de todo lo planificado… Con estos proyectos tecnológicos se toma en cuenta no sólo la máquina sino la persona que las maneja. La Feria de Innovadores Populares o Tecnólogos permitirá darle un impulso a los innovadores tecnológicos.', 'Feria de Innovadores Populares o Tecnólogos. Parque Los Caobos, Dtto. Capital, 26 de abril de 2008.', 'img/chavez/090.png');
INSERT INTO frases_chavez VALUES (549, 'Impulsar la aplicación de la Televisión Digital Terrestre en territorio venezolano: Es muy importante este convenio, ya que nos permite independizarnos en lo que a las comunicaciones se refiere y damos un paso al frente ante esas empresas imperialistas que se encargan de tergiversar la información que ocurre en el mundo.', 'Consejo de Ministros Palacio de Miraflores. Caracas, Dtto. Capital, 20 de marzo de 2013.', NULL);
INSERT INTO frases_chavez VALUES (543, 'La creación del Estado mayor de ciencia y tecnología debe estar insertado en las 3R (revisión, rectificación y reimpulso).... Si no lo engranamos, ideas maravillosas como los proyectos que estamos aprobando este día, se los podría llevar el viento.', 'Feria de Innovadores Populares o Tecnólogos. Parque Los Caobos, Dtto. Capital, 26 de abril de 2008.', 'img/chavez/090.png');
INSERT INTO frases_chavez VALUES (546, 'Hago un llamado al pueblo y a los científicos a profundizar el estudio y el conocimiento para trabajar por encima de ideologías, sin importar cómo pienses sobre Chávez. Lo que importa es que seas venezolano y sientas la patria en las vísceras.', 'Encuentro de Tecnólogos, Empresarios y Científicos. Fundación de Institutos de Estudios Avanzados (IDEA). Municipio Baruta del Edo. Miranda, 06 de marzo de 2012.', 'img/chavez/028.png');
INSERT INTO frases_chavez VALUES (544, 'La misión ciencia que hoy nace, tiene un conjunto de vertientes, de líneas estrategicas y una de esas líneas es la popularización de la ciencia, incluso esa capacidad inventiva que ustedes tienen de inventiva popular, impulsarla y multiplicarla. Hoy es un día histórico para el país, hoy nace la Misión Ciencia para Venezuela, para los pueblos hermanos de América Latina y el Caribe.', 'Programa Aló Presidente N° 247, 19 de febrero 2005. Ciudad Guayana, Edo. Bolívar.', NULL);
INSERT INTO frases_chavez VALUES (541, 'La Revolución está creando una tecnología social, lo que buscamos es la organización para la producción, para que los proyectos sean viables deben insertarse en un entorno social, que también requiere de una metodología, es el hecho de cómo hacer las cosas, es el desarrollo de la fuerza productiva.', 'Feria de Innovadores Populares o Tecnólogos. Parque Los Caobos, Dtto. Capital, 26 de abril de 2008.', 'img/chavez/028.png');
INSERT INTO frases_chavez VALUES (551, 'Estamos en el momento preciso de dos saltos: uno cualitativo, cambiar los paradigmas de la televisión en Venezuela y hacer una televisión para la vida, la paz, el amor, la patria, para los grandes valores, entretenida y de calidad. El segundo salto es el tecnológico, para que todo el mundo tenga acceso a este servicio por la vía de la televisión digital.', 'Presidente Nicolás Maduro. Lanzamiento del Canal Conciencia TV en período de prueba. Plaza de Los Museos, Dtto. Capital, 12 de abril de 2013.', 'img/chavez/m002.png');
INSERT INTO frases_chavez VALUES (553, 'El esfuerzo central: las grandes políticas colectivas. La construcción de un sistema de gobierno popular, que tenga la capacidad para gestionar toda la problemática popular y para dirigir una política transformadora sobre los problemas de manera coherente que nos permitan darle respuesta al pueblo.', 'Presidente Nicolás Maduro. Universidad Politécnica Andrés Eloy Blanco. Barquisimeto, Edo. Lara, 13 de junio 2013.', 'img/chavez/m003.png');
INSERT INTO frases_chavez VALUES (540, 'La fábrica de Pequeños Satélites, permitirá profundizar la independencia tecnológica del país, para
INSERT INTO frases_chavez VALUES (552, '¡Venezuela, se ha lanzado el satélite Miranda! Nuestro país continúa desplegando su soberanía e independencia en materia tecnológica. Una mirada soberana sobre nuestro territorio velará por nuestro crecimiento como nación libre.', 'Lanzamiento y puesta en órbita del VRSS-1 Miranda. Palacio de Miraflores, 28 de septiembre de 2012.', 'img/chavez/090.png');
INSERT INTO frases_chavez VALUES (550, 'Estas computadoras tienen un conjunto de informaciones, son un instrumentos tecnológicos para el estudio y formación de los estudiantes además, les permite estar compenetrados con el mundo de la tecnología. Esta es una inversión que hace la Patria en tecnología para la juventud.', 'Presidente Nicolás Maduro. Entrega de las primeras computadoras Canaima a estudiantes de secundaria. Gobierno de Calle. Municipio Guanta, Edo. Anzoátegui. 23 de mayo 2013.', 'img/chavez/m001.png');
INSERT INTO frases_chavez VALUES (545, 'Al fin estamos comenzando a contar en Venezuela con un sistema de ciencia y tecnología, los avances científicos y tecnológicos nacionales, dan el salto y se desarrollan en función de lo humano y no para la destrucción y acumulación de capital. Es la ciencia útil, necesaria para impulsar el desarrollo integral del país, el desarrollo nacional.', 'Encuentro de Tecnólogos, Empresarios y Científicos. Fundación de Institutos de Estudios Avanzados (IDEA). Municipio Baruta del Edo. Miranda, 06 de marzo de 2012.', 'img/chavez/115.png');
INSERT INTO frases_chavez VALUES (554, 'La corrupción es una enfermedad que afecta la salud pública y quebranta el órgano de la República, si la corrupción continúa perpetuándose en las bases del capitalismo aquí no podrá afianzarse el socialismo, llamo al pueblo a no tolerar la corrupción ni de cuello amarillo ni de cuello rojo, la haga quien la haga, es la misma conducta apátrida y antipopular, vístase como se vista, hemos pasado a la ofensiva en esta batalla y no la abandonaremos.', 'Presidente Nicolás Maduro. Solicitud ante la Asamblea Nacional de la Ley Habilitante contra la corrupción. Palacio Legislativo, 8 de 0ctubre 2013.', 'img/chavez/m004.png');
INSERT INTO frases_chavez VALUES (555, 'Una política de estado tiene que ser para resolver las necesidades colectivas en lo fundamental y tener capacidad para atender al ciudadano en su necesidad individual también, es complementario, pero el esfuerzo central mío como Presidente y del Gobierno, de nosotros, es las grandes política colectivas.', 'Presidente Nicolás Maduro. Universidad Politécnica Andrés Eloy Blanco. Barquisimeto, Edo. Lara, 13 de junio 2013.', 'img/chavez/m005.png');
INSERT INTO frases_chavez VALUES (556, '¡La batalla por la independencia y la prosperidad nacional la debemos ganar todos los días, con fe en nuestra Patria y espíritu de victoria!', 'Presidente Nicolás Maduro. Fuente: MINCI 24 de Septiembre de 2013 Palacio de Miraflores. Caracas', 'img/chavez/m006.png');
INSERT INTO frases_chavez VALUES (557, 'Sigue en las calles nuestro Comandante, sigue en nuestros corazones. Allí donde hay un compatriota haciendo Patria, ahí está Chávez protegiendo al humilde, al pobre, al trabajador a la clase media', 'Presidente Nicolás Maduro. Fuente: Diario Ciudad Caracas. Lanzamiento de la Misión Barrio Nuevo Barrio Tricolor Edo. Aragua', 'img/chavez/m007.png');
INSERT INTO frases_chavez VALUES (564, 'Aquí nos dejó nuestro Comandante Chávez con una tarea, con una misión, y aquí la llevamos: consolidar a Venezuela, su democracia y seguir consolidando nuestra Suramérica.', 'Nicolás Maduro. Fuente: SIBCI 12-11-2012', 'img/chavez/m014.png');
INSERT INTO frases_chavez VALUES (558, 'El pueblo debe ser protagonista de las bases económicas del socialismo bolivariano y las comunas, el mas poderoso instrumento para construir el Plan de la Patria de manera integral, de abajo hacia arriba.', 'Nicolás Maduro. Fuente: SIBCI 16-11-2013. Palacio de Miraflores en el marco del I Encuentro de Comuneros', 'img/chavez/m008.png');
INSERT INTO frases_chavez VALUES (559, 'El Gobierno Bolivariano trabaja en la Revolución Democrática Comunal del Socialismo venezolano.', 'Nicolás Maduro. Fuente: SIBCI. Jornada del Censo Comunal, 7  de septiembre de 2013', 'img/chavez/m009.png');
INSERT INTO frases_chavez VALUES (560, 'Pido Unión a todo el país para seguir consolidando la ofensiva económica y proteger al pueblo de los capitalistas usureros que lo roban.', 'Fuente: @NicolasMaduro. 19-11-2013. En el marco de la aprobación de la Ley Habilitante en la Asamblea Nacional.', 'img/chavez/m010.png');
INSERT INTO frases_chavez VALUES (561, 'Construyamos una economía con base productiva, una poderosa economía o no habrá socialismo.', 'Nicolás Maduro. Fuente: SIBCI 16-11-2013. Palacio de Miraflores. I Encuentro de Comuneros', 'img/chavez/m011.png');
INSERT INTO frases_chavez VALUES (562, 'Estamos construyendo una poderosa Fuerza Armada Nacional Bolivariana, disciplinda, subordinada profundamente a la Constitución y al pueblo.', 'Nicolás Maduro. Fuente. Diario Últimas Noticias, 13-11-2013. Centro de Adiestramiento y Combate José Laurencio Silva en El Pao, Edo. Cojedes', 'img/chavez/m012.png');
INSERT INTO frases_chavez VALUES (563, 'Hemos trabajado para consolidar una zona económica de desarrollo compartido con el Alianza Bolivariana para los Pueblos de Nuestra América (Alba), con Petrocaribe, agruparnos para actividades económicas, inversiones conjuntas, para el desarrollo comercial, y muchos otros proyectos.', 'Nicolás Maduro. Fuente: SIBCI 12-11-2012', 'img/chavez/m013.png');
INSERT INTO frases_chavez VALUES (570, 'El llamado que hago es a la paz del país, nosotros estamos para trabajar. Al pueblo alerta para vigilar la paz, para preservar la paz.', 'Nicolás Madruo. Fuente: SIBCI 25 de Abril de 2013. Parroquia el Valle, Caracas.', 'img/chavez/m020.png');
INSERT INTO frases_chavez VALUES (566, 'Tengan la seguridad de que hagan lo que hagan los enemigos de la patria aquí habrá paz, paz y más paz para la familia de Venezuela. Tranquilidad, trabajo, vida y prosperidad. No podrán perturbar más nunca la paz y la vida de este país.', 'Nicolás Maduro. Fuente Sibci. 19-11-2013. Aprobación Ley Habilitante', 'img/chavez/m016.png');
INSERT INTO frases_chavez VALUES (567, 'Visitaré el estado para arrancar las giras del Gobierno de calle, voy con todo nuestro equipo a trabajar por el Zulia y Venezuela.', '@NicolasMaduro. En el marco de segundo gobierno de calle. 19 de Octubre de 2013', 'img/chavez/m017.png');
INSERT INTO frases_chavez VALUES (568, 'Hoy viernes, 1° de Noviembre, quisimos decretar la llegada de la navidad porque queremos la felicidad para todo el pueblo, la paz y la felicidad para todos, la navidad temprana es la mejor vacuna para cualquiera que puedan inventar.', 'Nicolás Maduro. Fuente: SIBCI 01 de Noviembre 2013. Parque Los Caobos, en la ciudad de Caracas.', 'img/chavez/m018.png');
INSERT INTO frases_chavez VALUES (569, 'Decir Bolívar en el siglo XXI es decir Chávez, no se podrá entender a Bolívar sin pasar por Chávez, al final fueron el mismo espíritu, la misma idea, proyecto y el mismo pueblo en circunstancias distintas.', 'Nicolás Maduro. Fuente: SIBCI 6 de Noviembre 2013', 'img/chavez/m019.png');
INSERT INTO frases_chavez VALUES (571, 'La espada de Bolívar es la del pueblo en batalla permanente.', 'Nicolás Maduro. Fuente: rnv.gob.ve  07 de Octubre de 2013, Caracas', 'img/chavez/m021.png');
INSERT INTO frases_chavez VALUES (572, 'Hemos logrado algo que jamás, ni nunca creía nadie que podíamos lograr: hemos bajado los precios de los productos, primera vez en el país (…) Abajo los precios, abajo los especuladores, abajo la conspiración, ¡arriba el pueblo de Venezuela! ¡arriba la Revolución de Bolívar!, ¡arriba la patria!', 'Nicolá Maduro. Fuente: Diario Ciudad Caracas, 18-11-2013', 'img/chavez/m022.png');
INSERT INTO frases_chavez VALUES (573, 'Abajo los precios. Abajo la especulación… Abajo la corrupción y el ladronaje. Arriba el pueblo… Arriba la Revolución Bolivariana.', 'Nicolás Maduro. Fuente: vtv.gob.ve Caracas, 17 de noviembre de 2013', 'img/chavez/m023.png');
INSERT INTO frases_chavez VALUES (574, 'Consolidar las comunas es un objetivo fundacional del chavismo: Sin comunas no habrá Patria nueva, sin comunas se acabaría todo. La comuna es el epicentro para la vida verdaderamente humana, en socialismo.', 'Nicolás Maduro. Fuente: SIBCI Caracas 16 de Noviembre de 2013', 'img/chavez/m024.png');
INSERT INTO frases_chavez VALUES (575, 'Tenemos un plan, tenemos un proyecto... Este pueblo no despertó con Chávez para volver a las tinieblas y andar de rodillas otra vez, frente a las élites enriquecidas que han saqueado a este país, convoco a toda Venezuela a que sumemos en esta batalla contra la derecha del país.', 'Presidente Nicolás Maduro decreta acciones para derrotar guerra económica. Fuente: TELESUR 6 de Noviembre de 2013', 'img/chavez/m025.png');
INSERT INTO frases_chavez VALUES (565, '… Ofensiva económica en contra de la usura y la especulación… Vamos a consolidar los precios justos contra la usura capitalista.', 'Nicolás Maduro. Fuente: Diario Últimas Noticias. 21-11-2013. Aprobación Ley Habilitante', 'img/chavez/m015.png');
INSERT INTO frases_chavez VALUES (286, 'Hemos dejado de ser una colonia petrolera, comenzamos a cumplir el deseo del eminente venezolano Arturo Uslar Pietri: Hay que sembrar el petróleo.', 'Hugo Rafael Chávez Frías', 'img/chavez/022.png');
INSERT INTO frases_chavez VALUES (414, 'Queremos que el gobierno imperialista termine de aceptar la realidad: ¡Venezuela se liberó, y se liberó para siempre! ¡Venezuela no es, ni será más nunca, una colonia norteamericana!', 'Hugo Rafael Chávez Frías', 'img/chavez/079.png');
INSERT INTO frases_chavez VALUES (415, '¡Venezuela no es, ni será más nunca, una colonia norteamericana!', 'Hugo Rafael Chávez Frías', 'img/chavez/048.png');
INSERT INTO frases_chavez VALUES (259, 'Invocamos a nuestros libertadores, invocamos a Dios Todopoderoso, a Cristo Redentor, para que nos permita continuar avanzando por esta vereda que cada día será más ancha, más próspera y más libre.', 'Hugo Rafael Chávez Frías', 'img/chavez/062.png');
INSERT INTO frases_chavez VALUES (386, 'El neoliberalismo es como cuando el cáncer entra en metástasis: el capitalismo en su fase neoliberal mata a la vida social, la acaba, la descuaja, la tritura.', 'Hugo Rafael Chávez Frías', 'img/chavez/011.png');
INSERT INTO frases_chavez VALUES (447, 'En el marco del sistema capitalista es imposible derrotar la exclusión y el atropello a la mujer, porque el sistema capitalista tiene su base en los antivalores de la exclusión, el machismo, la violencia, la degradación de los valores humanos, y particularmente de la mujer.', 'Hugo Rafael Chávez Frías', 'img/chavez/138.png');
INSERT INTO frases_chavez VALUES (455, 'Hoy, cuando comienza el siglo XXI, cuán importante es —mucho más que ayer— el avance de los movimientos de mujeres en el mundo, para romper definitivamente las cadenas de opresión y dominación.', 'Hugo Rafael Chávez Frías', 'img/chavez/035.png');
INSERT INTO frases_chavez VALUES (295, 'Es fundamental para el proyecto nacional la ciencia y la tecnología. Hay que aplicar la ciencia y la tecnología en todas las cosas, por más sencillas que sean.', 'Hugo Rafael Chávez Frías', 'img/chavez/115.png');
INSERT INTO frases_chavez VALUES (539, 'Un salto tecnológico, ¡Es el futuro!... Esto es parte del desarrollo científico y tecnológico de la nación en función de nuestras necesidades.', 'Lanzamiento del Satélite Francisco de Miranda desde China. 28 de septiembre 2012.', 'img/chavez/090.png');
