INSERT INTO plan_patria_oe VALUES (1, 'DEFENDER, EXPANDIR Y CONSOLIDAR EL BIEN MÁS PRECIADO QUE HEMOS RECONQUISTADO DESPUÉS DE 200 AÑOS: LA INDEPENDENCIA NACIONAL', 'I.');
INSERT INTO plan_patria_oe VALUES (2, 'CONTINUAR CONSTRUYENDO EL SOCIALISMO BOLIVARIANO DEL SIGLO XXI, EN VENEZUELA, COMO ALTERNATIVA AL SISTEMA DESTRUCTIVO Y SALVAJE DEL CAPITALISMO, Y CON ELLO ASEGURAR LA «MAYOR SUMA DE SEGURIDAD SOCIAL, MAYOR SUMA DE ESTABILIDAD POLITICA Y LA MAYOR SUMA DE FELICIDAD, PARA NUESTRO PUEBLO', 'II.');
INSERT INTO plan_patria_oe VALUES (3, 'CONVERTIR A VENEZUELA EN UN PAÍS POTENCIA EN LO SOCIAL, LO ECONÓMICO Y LO POLÍTICO DENTRO DE LA GRAN POTENCIA NACIENTE DE AMÉRICA LATINA Y EL CARIBE, QUE GARANTICEN LA CONFORMACIÓN DE UNA ZONA DE PAZ EN NUESTRA AMÉRICA', 'III.');
INSERT INTO plan_patria_oe VALUES (4, 'CONTRBUIR AL DESARROLLO DE UNA NUEVA GEOPOLÍTICA INTERNACIONAL EN LA CUAL TOME CUERPO MUNDO MULTICENTRICO Y PLURIPOLAR QUE PERMITA LOGRAR EL EQUILIBRIO DEL UNIVERSO Y GARANTIZAR LA PAZ PLANETARIA', 'IV.');
INSERT INTO plan_patria_oe VALUES (5, 'CONTRIBUIR CON LA PRESERVACIÓN DE LA VIDA EN EL PLANETA Y LA SALVACIÓN DE LA ESPECIE HUMANA', 'V.');
INSERT INTO plan_patria_on VALUES (19, 5, 'Construir e impulsar el modelo económico productivo eco-socialista, basado en una relación armónica entre el hombre y la naturaleza, que garantice el uso y aprovechamiento racional, óptimo y sostenible de los recursos naturales, respetando los procesos y ciclos de la naturaleza', '5.1.');
INSERT INTO plan_patria_on VALUES (1, 1, 'Garantizar la continuidad y consolidación de la Revolución Bolivariana en el poder', '1.1.');
INSERT INTO plan_patria_on VALUES (2, 1, 'Preservar y consolidar la soberanía sobre los recursos petroleros y demás recursos naturales estratégicos', '1.2.');
INSERT INTO plan_patria_on VALUES (3, 1, 'Garantizar el manejo soberano del ingreso nacional', '1.3.');
INSERT INTO plan_patria_on VALUES (4, 1, 'Lograr la soberanía alimentaria para garantizar el sagrado derecho a la alimentación de nuestro pueblo', '1.4.');
INSERT INTO plan_patria_on VALUES (7, 2, 'Propulsar la transformación del sistema económico, en función de la transición al socialismo bolivariano, trascendiendo el modelo rentista petrolero capitalista hacia el modelo económico productivo socialista, basado en el desarrollo de las fuerzas productivas', '2.1.');
INSERT INTO plan_patria_on VALUES (6, 1, 'Fortalecer el poder defensivo nacional para proteger la Independencia y la soberanía nacional, asegurando los recursos y riquezas de nuestro país para las futuras generaciones', '1.6.');
INSERT INTO plan_patria_on VALUES (8, 2, 'Construir una sociedad igualitaria y justa', '2.2.');
INSERT INTO plan_patria_on VALUES (9, 2, 'Consolidar y expandir el poder popular y la democracia socialista', '2.3.');
INSERT INTO plan_patria_on VALUES (10, 2, 'Convocar y promover una nueva orientación ética, moral y espiritual de la sociedad, basada en los valores liberadores del socialismo', '2.4.');
INSERT INTO plan_patria_on VALUES (11, 2, 'Lograr la irrupción definitiva del Nuevo Estado Social y Democrático, de Derecho y de Justicia', '2.5.');
INSERT INTO plan_patria_on VALUES (14, 3, 'Profundizar el desarrollo de la nueva geopolítica nacional y regional, latinoamericana y caribeña', '3.3.');
INSERT INTO plan_patria_on VALUES (12, 3, 'Consolidar el papel de Venezuela como Potencia Energética Mundial', '3.1.');
INSERT INTO plan_patria_on VALUES (13, 3, 'Desarrollar el poderío económico de la Nación en base al aprovechamiento óptimo de las potencialidades que ofrecen nuestros recursos para la generación de la máxima felicidad de nuestro pueblo, así como de las bases materiales para la construcción de nuestro socialismo bolivariano', '3.2.');
INSERT INTO plan_patria_on VALUES (15, 4, 'Continuar desempeñando un papel protagónico en la construcción de la unión latinoamericana y caribeña', '4.1.');
INSERT INTO plan_patria_on VALUES (17, 4, 'Continuar impulsando el desarrollo de un Mundo pluripolar sin dominación imperial y con respeto a la autodeterminación de los pueblos', '4.3.');
INSERT INTO plan_patria_on VALUES (21, 5, 'Defender y proteger el patrimonio histórico y cultural venezolano y nuestroamericano', '5.3.');
INSERT INTO plan_patria_on VALUES (22, 5, 'Contribuir a la conformación de un gran movimiento mundial para contener las causas y reparar los efectos del cambio climático que ocurren como consecuencia del modelo capitalista depredador', '5.4.');
INSERT INTO plan_patria_on VALUES (18, 4, 'Contribuir con el desmontaje del antihistórico y nefasto sistema imperial y neocolonial', '4.4.');
INSERT INTO plan_patria_on VALUES (20, 5, 'Proteger y defender la soberanía permanente del Estado sobre los recursos naturales para el beneficio supremo de nuestro Pueblo, que será su principal garante', '5.2.');
INSERT INTO plan_patria_on VALUES (5, 1, 'Desarrollar nuestras capacidades científico-tecnológicas vinculadas a las necesidades del pueblo', '1.5.');
INSERT INTO plan_patria_on VALUES (16, 4, 'Afianzar la Identidad Nacional y Nuestroamericana', '4.2.');
